INSERT INTO `at_posts` VALUES (1,1,'2018-02-08 11:34:56','2018-02-08 13:34:57','Bem-vindo ao WordPress. Esse é o seu primeiro post. Edite-o ou exclua-o, e então comece a escrever!','Olá, mundo!','','publish','open','open','','ola-mundo','','','2018-02-08 11:34:56','2018-02-08 13:34:57','',0,'http://atletasnow.com.br/?p=1',0,'post','',1),(2,1,'2018-02-08 11:34:56','2018-02-08 13:34:57','Este é o exemplo de uma página. É diferente de um post de blog porque é estática e pode aparecer em menus de navegação (na maioria dos temas). A maioria das pessoas começam com uma página \'Sobre\' que as apresenta aos potenciais visitantes do site. Você pode usar algo como:\n\n<blockquote>Oi! Sou um estudante de Biologia e gosto de esportes e natureza. Nos fins-de-semana pratico futebol com meus amigos no clube local. Eu moro em Valinhos e fiz este site para falar sobre minha cidade.</blockquote>\n\n...ou algo como:\n\n<blockquote>A empresa Logos foi fundada em 1980, e tem provido o comércio local com o que há de melhor em informatização. Localizada em Recife, nossa empresa tem se destacado como um das que também contribuem para o descarte correto de equipamentos eletrônicos substituídos.</blockquote>\n\nComo um novo usuário WordPress, vá ao seu <a href=\"http://atletasnow.com.br/wp-admin/\">Painel</a> para excluir este conteúdo e criar o seu. Divirta-se!','Página de exemplo','','publish','closed','open','','pagina-exemplo','','','2018-02-08 11:34:56','2018-02-08 13:34:57','',0,'http://atletasnow.com.br/?page_id=2',0,'page','',0),(4,1,'2018-02-08 11:56:46','2018-02-08 13:56:46','','Cadastro','','publish','closed','closed','','cadastro','','','2018-02-08 11:56:46','2018-02-08 13:56:46','',0,'http://atletasnow.com.br/?page_id=4',0,'page','',0),(5,1,'2018-02-08 11:56:46','2018-02-08 13:56:46','','Cadastro','','inherit','closed','closed','','4-revision-v1','','','2018-02-08 11:56:46','2018-02-08 13:56:46','',4,'http://atletasnow.com.br/2018/02/08/4-revision-v1/',0,'revision','',0),(6,1,'