 e\r\noutros meios ou protocolos de comunicação.\r\n4.5. Uma vez cumpridas as formalidades de cadastro e em conformidade com as responsabilidades\r\nda cláusula XX, o usuário poderá optar pelo plano grátis ou de assinatura paga da cláusula XX. Ao\r\nutilizar os serviços da rede social ATLETAS NOW, os membros deverão se atentar, ainda, às\r\nseguintes regras de publicação, upload, distribuição e disponibilização de conteúdo:\r\n• comunicação de informações exatas com uso de identidade verdadeira;\r\n• proibindo-se distribuição de conteúdo, dados e informações falsas, maliciosas, insultante,\r\nobscena, ofensiva, de caráter violento ou que insulte a violência, xenofóbicas, racistas,\r\nhomofóbicas, agressivas a terceiros ou que violem a legislação em vigor;\r\n• cumprir com as leis aplicáveis, respeitar os direitos de terceiros como direitos de\r\npropriedade intelectual de terceiros (marcas, direitos autorais, etc.), direitos exclusivos\r\nsobre imagem e voz, proibindo-se a reprodução de conteúdo sem autorização dos titulares,\r\nobedecendo-se as condições destes Termos de Uso;\r\n• utilizar o site de forma legítima e específica de de acordo com o seu propósito de\r\naproximação a oportunidades de crescimento profissional e esportivo;\r\n• não utilizar softwares robôs ou automatizações tecnológicas equivalentes quando estiver\r\nnavegando no site ou acessando os seus serviços, e\r\n• não se utilizar das informações disponíveis na rede para serviços próprios de comunicação\r\npor spam, envio de e-mails não solicitados, “mass-mailings”, oferecimento ou participação\r\nde serviços semelhantes a “pirâmides” ou “Marketing Multi Nível” (MMN), publicitários ou\r\nnão.</p>\r\n<p style=\"text-align: center;\">6</p>\r\n<p style=\"text-align: center;\">4.6. Em caso de descumprimento às regras acima, o ATLETAS NOW poderá punir o usuário sem\r\naviso prévio, apagar o conteúdo postado, suspender e/ou cancelar o contrato e a conta, sem\r\ncompensação por eventuais pagamentos ao site, além de recusar futuros acessos pelo usuário.\r\n4.7. Os membros poderão apagar (deletar) a sua conta e perfil no próprio site, na seção específica\r\npara esse propósito.\r\n5. RESPONSABILIDADES DO USUÁRIO\r\n5.1. É de responsabilidade e dever dos usuários a criação de suas respectivas senhas, guardadas sob\r\nsigilo para preservar a confidencialidade do perfil, devendo reportar imediatamente ao ATLETAS\r\nNOW eventual uso não autorizado, cabendo aos membros a responsabilidade por perdas daí\r\nderivadas.\r\n5.2. As informações da conta do usuário são de sua exclusiva responsabilidade, inclusive em caso\r\nde danos ou prejuízos a terceiros, violações legais, ilícitos contra propriedade intelectual,\r\nreproduções indevidas, contrafações, plágio, postagens com conteúdo de caráter difamatório,\r\ncalunioso, violento, delituoso, obsceno, pornográfico, racista, homofóbico, ilegal ou de qualquer\r\noutra forma ofensivo.\r\n5.3. Para as hipóteses do item acima, o ATLETAS NOW estará totalmente isento de acusações ou\r\nresponsabilizações e se reserva no direito de tomar as medidas cabíveis para resguardar os\r\ninteresses da plataforma, a integridade de terceiros e demais usuários, sendo certo que poderá\r\nsuspender ou cancelar a conta do usuário responsável. O ATLETAS NOW poderá, ainda, excluir\r\nintegral ou parcialmente quaisquer comentários ou conteúdo que julgar inviáveis de publicação.\r\n6. PRIVACIDADE E USO DE INFORMAÇÕES PESSOAIS IDENTIFICÁVEIS E IDENTIFICADAS DO\r\nUSUÁRIO\r\nO ATLETASNOW POSSUI POLÍTICAS ESPECÍFICAS DE PRIVACIDADE DE DADOS PESSOAIS E\r\nINFORMAÇÕES PESSOAIS SENSÍVEIS DISPONÍVEIS EM XXX. AS INFORMAÇÕES DE REGISTRO\r\nE DADOS SOBRE O USUÁRIO ESTÃO SUJEITAS A ESSAS POLÍTICAS, AS QUAIS O USUÁRIO\r\nDECLARA HAVER LIDO, COMPREENDIDO E CONCORDADO. AS POLÍTICAS DE PRIVACIDADE\r\nREGULAM O USO E A PRESTAÇÃO DE SERVIÇOS REFERENTES À COLETA, TRATAMENTO E\r\nUTILIZAÇÃO DOS DADOS SOBRE O USUÁRIO, INCLUINDO-SE A TRANSFERÊNCIA DESSAS\r\nINFORMAÇÕES PARA ARMAZENAMENTO, PROCESSAMENTO E UTILIZAÇÃO POR ATLETAS\r\nNOW, EMPRESAS PARCEIRAS E DEMAIS EMPRESAS, PARA AS FINALIDADES ESPECÍFICAS DO\r\nSERVIÇO OFERECIDO E EVENTUAIS UTILIZAÇÕES PRESENTES NA REFERIDA POLÍTICA DE\r\nPRIVACIDADE QUE CONSTITUI PARTE INTEGRANTE DESTES TERMOS.</p>\r\n<p style=\"text-align: center;\">7</p>\r\n<p style=\"text-align: center;\">7. PROPRIEDADE INTELECTUAL\r\n7.1. As marcas, nomes, logotipos, nomes de domínio, propriedade intelectual em geral e demais\r\nsinais distintivos, bem como todo e qualquer conteúdo, desenho, arte, identidade visual, layout\r\npublicados no aplicativo ou site são de propriedade exclusiva do ATLETAS NOW, sendo vedado o</p>\r\n<p style=\"text-align: center;\">uso sem autorização prévia da plataforma, tampouco a reprodução parcial ou integral, sujeitando-\r\nse o infrator às medidas judiciais cabíveis, sem prejuízo de eventual indenização por perdas e</p>\r\n<p style=\"text-align: center;\">danos e honorários advocatícios ao ATLETAS NOW e a terceiros que venham a sofrer danos pelos\r\nreferidos atos ilegítimos.\r\n7.2. São vedados atos ou contribuições tendentes à descompilação, modificação das características,\r\nampliação, alteração, edição, transformação, distribuição ou incorporação em quaisquer outros\r\nprogramas, sistemas do aplicativo ou serviço, enfim, qualquer forma de reprodução do aplicativo,\r\nsoftware, serviço ou produtos oferecidos pelo ATLETAS NOW, total ou parcial, permanente,\r\ntemporária ou provisória, de forma gratuita ou onerosa, sob quaisquer modalidades, formas ou\r\ntítulos.\r\n8. PLANOS E SERVIÇOS DO ATLETAS NOW\r\n8.1. O ATLETAS NOW oferece diferentes planos de serviço aos usuários de sua plataforma, a\r\nseguir detalhados:\r\n(i) PLANO SIMPLES “ATLETAS NOW\" - possibilita o acesso à plataforma digital, conteúdos\r\ninformativos, comunicação com os técnicos, acesso à lista de clubes esportivos e\r\nfaculdades, email exclusivo ATLETAS NOW, acompanhamento de todo o processo de\r\nrecrutamento, promoção direta de perfil para os técnicos,\r\n(ii) “PLANO PREMIUM” - além dos serviços disponibilizados no plano simples acima, este\r\nplano PREMIUM possibilita ao usuário uma melhor experiência na plataforma, com\r\nbenefícios exclusivos e maiores possibilidades, como assessoria personalizada e online;\r\ncriação de vídeos editados profissionalmente, em número limitado; acesso a palestras e\r\naulas com ex-atletas e profissionais do esporte; inscrições preferenciais para showcases e\r\ncamps, além de dicas com orientação educacional e nutricional. Este plano será\r\ndisponibilizado aos usuários que pagarem o valor mensal de R$ 75,00 (setenta e cinco\r\nreais), como detalhado na página específica de assinatura, disponibilizada no site.\r\n(iii) “PLANO TÉCNICO” - Este plano será disponibilizado aos usuários que pagarem o valor\r\núnico de R$ 500,00 (quinhentos reais), como detalhado na página específica de assinatura.\r\n8.2. A forma de contratação dos PLANOS mencionados nos itens (ii) e (iii) anteriores serão\r\nrealizados por meio de um sistema digital a ser anunciado na página específica dessas assinaturas</p>\r\n<p style=\"text-align: center;\">8\r\nna plataforma ATLETAS NOW, disponibilizando-se o pagamento através de cartões de crédito,\r\ncartão de débito ou e/ou boletos bancários.\r\n8.3. Após a anuência ao PLANO, os serviços da plataforma serão cobrados automaticamente do\r\nusuário através da modalidade de pagamento por ele definida ao assiná-lo. Recomenda-se que o\r\nusuário leia os termos e condições próprios do método de pagamento cadastrado.\r\n8.4. O contrato com o usuário terá validade de um ano e o cancelamento dos PLANOS deverá ser\r\nfeito, pelo usuário, com um período de aviso prévio de trinta dias para a interrupção definitiva das\r\ncobranças.\r\n8.5. O ATLETAS NOW se reserva nos direitos de, a qualquer tempo e sem comunicação prévia,\r\nmodificar, descontinuar, interromper, modificar, editar, temporária ou permanentemente, os\r\nserviços e conteúdo oferecidos, inocorrendo violação a direitos do usuário ou implicações de\r\nresponsabilidades do ATLETAS NOW.\r\n9. DISPOSIÇÕES FINAIS\r\n9.1. Em caso de qualquer disposição destes Termos vir a ser considerada inválida, ineficaz ou nula,\r\npor qualquer órgão competente, as demais permanecerão em pleno vigor para todo e qualquer\r\nefeito.\r\n9.2. Eventual tolerância de qualquer das partes a infrações ou descumprimento das condições\r\nestipuladas nestes Termos será entendida como ato de mera liberalidade, não constituindo\r\nprecedente, novação ou renúncia a quaisquer direitos assegurados pela legislação ou pelos\r\npróprios Termos de Uso.\r\n9.3. As relações e funcionalidades aqui tratadas serão regidas pelas leis brasileiras. Fica eleito o\r\nforo da Comarca da Capital do Estado de São Paulo como o competente para dirimir eventuais\r\nlitígios decorrentes da relação contratual.\r\n9.4. As notificações e intimações dirigidas ao ATLETAS NOW deverão ser enviadas ao endereço\r\ndescrito de sua sede, constante nestes Termos.</p>','Termos de uso','','publish','closed','closed','','termos-de-uso','','','2018-06-21 02:27:49','2018-06-21 05:27:49','',0,'http://54.233.206.85/?page_id=202',0,'page','',0),(203,1,'2018-06-21 01:59:45','2018-06-21 04:59:45','TERMOS E CONDIÇÕES DE USO\r\nDO SITE ATLETAS NOW\r\n\r\nEste contrato (adiante “Termos de Uso” ou “Termos”) é celebrado entre ATLETAS NOW\r\nCONSULTORIA E ASSESSORIA ESPORTIVA LTDA., sociedade privada, inscrita no CNPJ sob o no\r\n27.059.681/001-10, com sede na Rua Domingos Fernandes, no 496, apto. 111, sl. 3, Vila Nova\r\nConceição, CEP 04509-011, na cidade de São Paulo, SP, Brasil, titular e controladora do site\r\nwww.atletasnow.com (adiante “aplicativo”, “plataforma”, “site” ou “ATLETAS NOW”) e, de outro\r\nlado, os USUÁRIOS do site ATLETAS NOW (adiante “atletas”, “empresários”, “treinadores”,\r\n“clubes”, “faculdades”, “técnicos”, “membros\"), conforme qualificação por ele informada no\r\nmomento do cadastro de sua conta na referida plataforma.\r\nEstes Termos valem para qualquer acesso ou uso do site, dentro ou fora do Brasil, e regula os\r\nserviços oferecidos pela rede social ATLETAS NOW, ou seja, a relação de intermediação entre\r\natletas e técnicos, faculdades, treinadores, empresários, interessados, membros, inclusive o uso de\r\nferramentas, dados, softwares, áudios, videos, licenças de uso de marca, nome, voz, imagem,\r\nfotografias, material promocional, de marketing, ofertas, eventos, atividades, promoções,\r\ndescontos, entre outros serviços e produtos disponibilizados pela plataforma, sem prejuízo da\r\nexistência de outros Termos, regulamentos e condições de uso específicos (“Termos Adicionais”) a\r\ncada um dos serviços ou produtos a seguir citados.\r\n1. OBJETIVOS DO ATLETAS NOW:\r\n1.1. O ATLETAS NOW é uma rede social esportiva que oferece aos usuários cadastrados uma\r\naplicação tecnológica (plataforma/site/aplicativo) pela qual os membros podem criar e publicar o\r\nseu perfil esportivo online, sob determinadas condições, com o intuito de desenvolver a sua rede\r\nde contatos profissionais, encontrar oportunidades de trabalho, recrutamento, troca de\r\nconhecimentos, experiências, mensagens, vídeos, fotos, ideias, obter dicas, divulgar produtos, tudo\r\nisso através de conexões e interações com outros membros, fóruns, páginas, blogs e eventos,\r\nrelacionados a esportes e áreas correlatas.\r\n1.2. Esses serviços são realizados por meio da intermediação entre atletas de qualquer modalidade,\r\nindependentes ou não, a técnicos, faculdades, treinadores, clubes esportivos e empresários do\r\nramo interessados na promoção, contratação, desenvolvimento, investimento e divulgação de\r\nnovas oportunidades aos atletas.\r\n1.3. Os serviços da plataforma são, em sua maioria, oferecidos de forma gratuita aos usuários,\r\nporém, há opções adicionais de acesso a determinados conteúdos e serviços de forma paga\r\n(adiante “PLANO PREMIUM” e “PLANO TÉCNICO”) cujos serviços serão de utilização exclusiva\r\ndos respectivos assinantes. Todos os usuários, sejam eles assinantes ou não dos planos de\r\nassinatura, submetem-se às regras deste Termos de Uso.\r\n\r\n3\r\n\r\n1.4. O USUÁRIO RECONHECE QUE O ATLETAS NOW É MERAMENTE UM CANAL DE\r\nINTERMEDIAÇÃO PARA A APROXIMAÇÃO, LOCALIZAÇÃO, DESENVOLVIMENTO E\r\nCONTATO ENTRE OS MEMBROS, SEM QUALQUER VÍNCULO COM TÉCNICOS OU ATLETAS.\r\nO ATLETAS NOW NÃO ASSEGURA A ORIGEM, IDENTIDADE, CONTEÚDO, ANÚNCIOS,\r\nPERFIS, SERVIÇOS, OU OPORTUNIDADES DIVULGADAS PELOS USUÁRIOS DA REDE SOCIAL\r\nATLETAS NOW, SENDO TAIS MEMBROS OS RESPONSÁVEIS EXCLUSIVOS PELO MATERIAL E\r\nINFORMAÇÕES POR ELES DIVULGADAS.\r\n1.5. O CONTATO ENTRE OS MEMBROS E EVENTUAIS CONTRATAÇÕES SÃO FEITAS\r\nDIRETAMENTE ENTRE ATLETAS E TÉCNICOS, TODOS INDEPENDENTES E SEM QUALQUER\r\nVÍNCULO SOCIETÁRIO OU DE SUBORDINAÇÃO COM O ATLETAS NOW, QUE NÃO SE\r\nRESPONSABILIZA POR QUAISQUER PERDAS, PREJUÍZOS OU DANOS DECORRENTES OU\r\nRELATIVOS AOS CONTATOS ESTABELECIDOS ATRAVÉS DA PLATAFORMA.\r\n2. ACEITAÇÃO DOS TERMOS E DISPOSIÇÕES GERAIS\r\n2.1. ANTES DE UTILIZAR OS SERVIÇOS DO ATLETAS NOW, O USUÁRIO DEVERÁ LER\r\nATENTAMENTE ESTES TERMOS. AO SE CADASTRAR E UTILIZAR OS SERVIÇOS, O USUÁRIO\r\nCONFIRMA QUE TERÁ LIDO, ENTENDIDO E ACEITADO TODOS OS TERMOS E CONDIÇÕES\r\nLISTADOS ABAIXO, ASSIM COMO AS POLÍTICAS DE PRIVACIDADE DO APLICATIVO,\r\nELABORADAS EM SEPARADO E DISPONÍVEIS NO LINK XXX. CASO, A QUALQUER TEMPO, O\r\nUSUÁRIO NÃO CONCORDE COM ESSES CONTRATOS, DEVERÁ DEIXAR DE UTILIZAR OS\r\nSERVIÇOS IMEDIATAMENTE, CANCELAR A SUA CONTA E DESINSTALAR O APLICATIVO.\r\n2.2. Eventuais “Termos Adicionais” serão devidamente informados aos usuários integrarão este\r\ncontrato. Em caso de conflito, prevalecerá o disposto nos Termos Adicionais em relação à matéria\r\nconflitante.\r\n2.3. O ATLETAS NOW poderá, a qualquer tempo e sem aviso prévio aos usuários, alterar,\r\nmodificar ou ajustar os Termos. Eventuais modificações que restrinjam os direitos dos usuários ou\r\nmodifiquem o tratamento de dados pessoais ou informações pessoais sensíveis serão comunicadas\r\ndevida e oportunamente. Isso não afasta a necessidade de o usuário rever os Termos com\r\nfrequência, pois se subordinam aos Termos vigentes no momento de seu acesso, uso, envio ou\r\nobtenção de conteúdo, produtos, promoções, informações, serviços ou ofertas. Caso não concorde,\r\no usuário deverá cancelar a sua conta, desinstalar o aplicativo e cessar as atividades no ATLETAS\r\nNOW.\r\n2.4. COMUNICAÇÕES: O usuário autoriza o ATLETAS NOW a enviar notificações no aplicativo,\r\nvia e-mail, mensagens de texto (“SMS”), em publicações no site, ou qualquer outro meio, com\r\n\r\n4\r\nconteúdo informativo e promocional relacionado aos serviços e produtos oferecidos. Caso deseje,\r\no usuário poderá revogar a autorização pelo canal específico da plataforma disponível em XXX.\r\n3. CADASTRO DO USUÁRIO\r\n3.1. Para se tornar um membro, cadastrar-se e utilizar a rede social ATLETAS NOW, o usuário deve\r\nter plena capacidade civil, ser maior de idade conforme a legislação local e/ou ser emancipado, ou\r\nser menor de 16 (dezesseis) anos, contanto que cadastrado pelos pais e/ou responsáveis legais e\r\nem respeito às cláusulas 3.3. e 3.4. abaixo; além de concordar que o uso da plataforma será restrito\r\na objetivos profissionais.\r\n3.2. O cadastro de instituições, faculdades, clubes esportivos, pessoas jurídicas e associações em\r\ngeral deverá ser feito por procuradores nomeados, com os devidos poderes de representação para\r\natuar em nome da empresa/sociedade e se responsabilizarão pelo conteúdo postado e informações\r\nde cadastro, os quais devem ser lícitos, verdadeiros, corretos e sempre atualizados.\r\n3.3. MENORES DE DEZESSEIS ANOS: O CADASTRO DE MENORES DE 16 (DEZESSEIS) ANOS\r\nDEVE SER FEITO PELOS PAIS E/OU RESPONSÁVEIS LEGAIS, após a avaliação e aceitação dos\r\npresentes termos, por sua conta e risco, responsabilizando-se por quaisquer atos ou\r\nconsequências relacionadas ao menor e sua conta na rede. CABERÁ AOS PAIS E/OU\r\nRESPONSÁVEIS LEGAIS A ANÁLISE PRÉVIA DE DADOS PESSOAIS SOLICITADOS EM RELAÇÃO\r\nA ESSES MENORES, A SUPERVISÃO, ADEQUAÇÃO, GERENCIAMENTO E INSTRUÇÃO SOBRE\r\nO USO DA REDE SOCIAL E DOS SERVIÇOS OFERECIDOS PELO ATLETAS NOW. ESTAS SÃO\r\nCONDIÇÕES VITAIS PARA O PRESENTE CONTRATO.\r\n3.4. O usuário deverá preencher os campos de cadastro solicitados, com informações verídicas,\r\nsempre atualizadas, corretas e não poderá deixar que terceiros utilizem o seu perfil, nome de\r\nusuário (“login”) ou senha, pois são dados pessoais, exclusivos e intransferíveis. Caso o usuário\r\ntenha menos de 16 (dezesseis) anos, a sua conta deverá ser supervisionada pelos pais e/ou\r\nresponsáveis legais, conforme acordado nestes Termos e nas cláusulas 3.1. e 3.3. acima.\r\n3.5. Informações falsas, inapropriadas, ilícitas, incompletas ou desatualizadas que violem ou\r\ncausem danos a direitos de terceiros poderão levar o ATLETAS NOW, sem aviso prévio, a apagar o\r\nconteúdo postado, suspender e/ou cancelar o contrato e a conta, sem compensação por eventuais\r\npagamentos ao site, além de recusar futuros acessos pelo usuário.\r\n3.6. Em nenhuma hipótese, o ATLETAS NOW será responsável por erro, omissão, falsidade,\r\ninexatidão nas informações disponibilizadas pelo usuário em sua conta e perfil.\r\n4. SERVIÇOS E UTILIZAÇÃO DO ATLETAS NOW\r\n\r\n5\r\n4.1. Ao utilizar a plataforma ATLETAS NOW e publicar conteúdo, como vídeos, fotos, textos,\r\ndados e informações pessoais, os usuários concordam com a sua exibição e publicidade, para os\r\ndemais membros da rede social e usuários da Internet, em consonância com os parâmetros optados\r\nnas preferências de cadastro, de forma que outros membros da rede poderão contatá-los através\r\ndessas informações, para o cumprimento dos objetivos da rede social ATLETAS NOW.\r\n4.2. Para atingir a finalidade da plataforma, o ATLETAS NOW poderá reproduzir, utilizar, adaptar,\r\npublicar, anunciar, divulgar e traduzir para qualquer idioma, parte ou a integralidade do conteúdo\r\ne dos dados disponibilizados por seus membros no referido site, em qualquer meio digital,\r\ninclusive mas não limitado a servidores, hard drives removíveis ou não, \"memory cards”, ou\r\nqualquer outro suporte tecnológico equivalente, em qualquer formato, por qualquer meio ou\r\nprocesso, para armazenamento, transmissão ou “download”.\r\n4.3. O usuário autoriza o ATLETAS NOW a divulgar resultados de recrutamento, aproveitamento e\r\nseleção de atletas ocorridos por meio da rede social.\r\n4.4. A autorização do usuário para tal reprodução, utilização, adaptação, publicação e tradução\r\nservirá para que o ATLETAS NOW distribua conteúdo e dados para tornar essas informações\r\npúblicas em todo o mundo, nas localidades de sua atuação, através de redes digitais, internet e\r\noutros meios ou protocolos de comunicação.\r\n4.5. Uma vez cumpridas as formalidades de cadastro e em conformidade com as responsabilidades\r\nda cláusula XX, o usuário poderá optar pelo plano grátis ou de assinatura paga da cláusula XX. Ao\r\nutilizar os serviços da rede social ATLETAS NOW, os membros deverão se atentar, ainda, às\r\nseguintes regras de publicação, upload, distribuição e disponibilização de conteúdo:\r\n• comunicação de informações exatas com uso de identidade verdadeira;\r\n• proibindo-se distribuição de conteúdo, dados e informações falsas, maliciosas, insultante,\r\nobscena, ofensiva, de caráter violento ou que insulte a violência, xenofóbicas, racistas,\r\nhomofóbicas, agressivas a terceiros ou que violem a legislação em vigor;\r\n• cumprir com as leis aplicáveis, respeitar os direitos de terceiros como direitos de\r\npropriedade intelectual de terceiros (marcas, direitos autorais, etc.), direitos exclusivos\r\nsobre imagem e voz, proibindo-se a reprodução de conteúdo sem autorização dos titulares,\r\nobedecendo-se as condições destes Termos de Uso;\r\n• utilizar o site de forma legítima e específica de de acordo com o seu propósito de\r\naproximação a oportunidades de crescimento profissional e esportivo;\r\n• não utilizar softwares robôs ou automatizações tecnológicas equivalentes quando estiver\r\nnavegando no site ou acessando os seus serviços, e\r\n• não se utilizar das informações disponíveis na rede para serviços próprios de comunicação\r\npor spam, envio de e-mails não solicitados, “mass-mailings”, oferecimento ou participação\r\nde serviços semelhantes a “pirâmides” ou “Marketing Multi Nível” (MMN), publicitários ou\r\nnão.\r\n\r\n6\r\n\r\n4.6. Em caso de descumprimento às regras acima, o ATLETAS NOW poderá punir o usuário sem\r\naviso prévio, apagar o conteúdo postado, suspender e/ou cancelar o contrato e a conta, sem\r\ncompensação por eventuais pagamentos ao site, além de recusar futuros acessos pelo usuário.\r\n4.7. Os membros poderão apagar (deletar) a sua conta e perfil no próprio site, na seção específica\r\npara esse propósito.\r\n5. RESPONSABILIDADES DO USUÁRIO\r\n5.1. É de responsabilidade e dever dos usuários a criação de suas respectivas senhas, guardadas sob\r\nsigilo para preservar a confidencialidade do perfil, devendo reportar imediatamente ao ATLETAS\r\nNOW eventual uso não autorizado, cabendo aos membros a responsabilidade por perdas daí\r\nderivadas.\r\n5.2. As informações da conta do usuário são de sua exclusiva responsabilidade, inclusive em caso\r\nde danos ou prejuízos a terceiros, violações legais, ilícitos contra propriedade intelectual,\r\nreproduções indevidas, contrafações, plágio, postagens com conteúdo de caráter difamatório,\r\ncalunioso, violento, delituoso, obsceno, pornográfico, racista, homofóbico, ilegal ou de qualquer\r\noutra forma ofensivo.\r\n5.3. Para as hipóteses do item acima, o ATLETAS NOW estará totalmente isento de acusações ou\r\nresponsabilizações e se reserva no direito de tomar as medidas cabíveis para resguardar os\r\ninteresses da plataforma, a integridade de terceiros e demais usuários, sendo certo que poderá\r\nsuspender ou cancelar a conta do usuário responsável. O ATLETAS NOW poderá, ainda, excluir\r\nintegral ou parcialmente quaisquer comentários ou conteúdo que julgar inviáveis de publicação.\r\n6. PRIVACIDADE E USO DE INFORMAÇÕES PESSOAIS IDENTIFICÁVEIS E IDENTIFICADAS DO\r\nUSUÁRIO\r\nO ATLETASNOW POSSUI POLÍTICAS ESPECÍFICAS DE PRIVACIDADE DE DADOS PESSOAIS E\r\nINFORMAÇÕES PESSOAIS SENSÍVEIS DISPONÍVEIS EM XXX. AS INFORMAÇÕES DE REGISTRO\r\nE DADOS SOBRE O USUÁRIO ESTÃO SUJEITAS A ESSAS POLÍTICAS, AS QUAIS O USUÁRIO\r\nDECLARA HAVER LIDO, COMPREENDIDO E CONCORDADO. AS POLÍTICAS DE PRIVACIDADE\r\nREGULAM O USO E A PRESTAÇÃO DE SERVIÇOS REFERENTES À COLETA, TRATAMENTO E\r\nUTILIZAÇÃO DOS DADOS SOBRE O USUÁRIO, INCLUINDO-SE A TRANSFERÊNCIA DESSAS\r\nINFORMAÇÕES PARA ARMAZENAMENTO, PROCESSAMENTO E UTILIZAÇÃO POR ATLETAS\r\nNOW, EMPRESAS PARCEIRAS E DEMAIS EMPRESAS, PARA AS FINALIDADES ESPECÍFICAS DO\r\nSERVIÇO OFERECIDO E EVENTUAIS UTILIZAÇÕES PRESENTES NA REFERIDA POLÍTICA DE\r\nPRIVACIDADE QUE CONSTITUI PARTE INTEGRANTE DESTES TERMOS.\r\n\r\n7\r\n\r\n7. PROPRIEDADE INTELECTUAL\r\n7.1. As marcas, nomes, logotipos, nomes de domínio, propriedade intelectual em geral e demais\r\nsinais distintivos, bem como todo e qualquer conteúdo, desenho, arte, identidade visual, layout\r\npublicados no aplicativo ou site são de propriedade exclusiva do ATLETAS NOW, sendo vedado o\r\n\r\nuso sem autorização prévia da plataforma, tampouco a reprodução parcial ou integral, sujeitando-\r\nse o infrator às medidas judiciais cabíveis, sem prejuízo de eventual indenização por perdas e\r\n\r\ndanos e honorários advocatícios ao ATLETAS NOW e a terceiros que venham a sofrer danos pelos\r\nreferidos atos ilegítimos.\r\n7.2. São vedados atos ou contribuições tendentes à descompilação, modificação das características,\r\nampliação, alteração, edição, transformação, distribuição ou incorporação em quaisquer outros\r\nprogramas, sistemas do aplicativo ou serviço, enfim, qualquer forma de reprodução do aplicativo,\r\nsoftware, serviço ou produtos oferecidos pelo ATLETAS NOW, total ou parcial, permanente,\r\ntemporária ou provisória, de forma gratuita ou onerosa, sob quaisquer modalidades, formas ou\r\ntítulos.\r\n8. PLANOS E SERVIÇOS DO ATLETAS NOW\r\n8.1. O ATLETAS NOW oferece diferentes planos de serviço aos usuários de sua plataforma, a\r\nseguir detalhados:\r\n(i) PLANO SIMPLES “ATLETAS NOW\" - possibilita o acesso à plataforma digital, conteúdos\r\ninformativos, comunicação com os técnicos, acesso à lista de clubes esportivos e\r\nfaculdades, email exclusivo ATLETAS NOW, acompanhamento de todo o processo de\r\nrecrutamento, promoção direta de perfil para os técnicos,\r\n(ii) “PLANO PREMIUM” - além dos serviços disponibilizados no plano simples acima, este\r\nplano PREMIUM possibilita ao usuário uma melhor experiência na plataforma, com\r\nbenefícios exclusivos e maiores possibilidades, como assessoria personalizada e online;\r\ncriação de vídeos editados profissionalmente, em número limitado; acesso a palestras e\r\naulas com ex-atletas e profissionais do esporte; inscrições preferenciais para showcases e\r\ncamps, além de dicas com orientação educacional e nutricional. Este plano será\r\ndisponibilizado aos usuários que pagarem o valor mensal de R$ 75,00 (setenta e cinco\r\nreais), como detalhado na página específica de assinatura, disponibilizada no site.\r\n(iii) “PLANO TÉCNICO” - Este plano será disponibilizado aos usuários que pagarem o valor\r\núnico de R$ 500,00 (quinhentos reais), como detalhado na página específica de assinatura.\r\n8.2. A forma de contratação dos PLANOS mencionados nos itens (ii) e (iii) anteriores serão\r\nrealizados por meio de um sistema digital a ser anunciado na página específica dessas assinaturas\r\n\r\n8\r\nna plataforma ATLETAS NOW, disponibilizando-se o pagamento através de cartões de crédito,\r\ncartão de débito ou e/ou boletos bancários.\r\n8.3. Após a anuência ao PLANO, os serviços da plataforma serão cobrados automaticamente do\r\nusuário através da modalidade de pagamento por ele definida ao assiná-lo. Recomenda-se que o\r\nusuário leia os termos e condições próprios do método de pagamento cadastrado.\r\n8.4. O contrato com o usuário terá validade de um ano e o cancelamento dos PLANOS deverá ser\r\nfeito, pelo usuário, com um período de aviso prévio de trinta dias para a interrupção definitiva das\r\ncobranças.\r\n8.5. O ATLETAS NOW se reserva nos direitos de, a qualquer tempo e sem comunicação prévia,\r\nmodificar, descontinuar, interromper, modificar, editar, temporária ou permanentemente, os\r\nserviços e conteúdo oferecidos, inocorrendo violação a direitos do usuário ou implicações de\r\nresponsabilidades do ATLETAS NOW.\r\n9. DISPOSIÇÕES FINAIS\r\n9.1. Em caso de qualquer disposição destes Termos vir a ser considerada inválida, ineficaz ou nula,\r\npor qualquer órgão competente, as demais permanecerão em pleno vigor para todo e qualquer\r\nefeito.\r\n9.2. Eventual tolerância de qualquer das partes a infrações ou descumprimento das condições\r\nestipuladas nestes Termos será entendida como ato de mera liberalidade, não constituindo\r\nprecedente, novação ou renúncia a quaisquer direitos assegurados pela legislação ou pelos\r\npróprios Termos de Uso.\r\n9.3. As relações e funcionalidades aqui tratadas serão regidas pelas leis brasileiras. Fica eleito o\r\nforo da Comarca da Capital do Estado de São Paulo como o competente para dirimir eventuais\r\nlitígios decorrentes da relação contratual.\r\n9.4. As notificações e intimações dirigidas ao ATLETAS NOW deverão ser enviadas ao endereço\r\ndescrito de sua sede, constante nestes Termos.','Termos de uso','','inherit','closed','closed','','202-revision-v1','','','2018-06-21 01:59:45','2018-06-21 04:59:45','',202,'http://54.233.206.85/sem-categoria/202-revision-v1/',0,'revision','',0),(204,1,'2018-06-21 02:27:45','2018-06-21 05:27:45','<p style=\"text-align: center;\">TERMOS E CONDIÇÕES DE USO\nDO SITE ATLETAS NOW</p>\nEste contrato (adiante “Termos de Uso” ou “Termos”) é celebrado entre ATLETAS NOW\nCONSULTORIA E ASSESSORIA ESPORTIVA LTDA., sociedade privada, inscrita no CNPJ sob o no\n27.059.681/001-10, com sede na Rua Domingos Fernandes, no 496, apto. 111, sl. 3, Vila Nova\nConceição, CEP 04509-011, na cidade de São Paulo, SP, Brasil, titular e controladora do site\nwww.atletasnow.com (adiante “aplicativo”, “plataforma”, “site” ou “ATLETAS NOW”) e, de outro\nlado, os USUÁRIOS do site ATLETAS NOW (adiante “atletas”, “empresários”, “treinadores”,\n“clubes”, “faculdades”, “técnicos”, “membros\"), conforme qualificação por ele informada no\nmomento do cadastro de sua conta na referida plataforma.\nEstes Termos valem para qualquer acesso ou uso do site, dentro ou fora do Brasil, e regula os\nserviços oferecidos pela rede social ATLETAS NOW, ou seja, a relação de intermediação entre\natletas e técnicos, faculdades, treinadores, empresários, interessados, membros, inclusive o uso de\nferramentas, dados, softwares, áudios, videos, licenças de uso de marca, nome, voz, imagem,\nfotografias, material promocional, de marketing, ofertas, eventos, atividades, promoções,\ndescontos, entre outros serviços e produtos disponibilizados pela plataforma, sem prejuízo da\nexistência de outros Termos, regulamentos e condições de uso específicos (“Termos Adicionais”) a\ncada um dos serviços ou produtos a seguir citados.\n1. OBJETIVOS DO ATLETAS NOW:\n1.1. O ATLETAS NOW é uma rede social esportiva que oferece aos usuários cadastrados uma\naplicação tecnológica (plataforma/site/aplicativo) pela qual os membros podem criar e publicar o\nseu perfil esportivo online, sob determinadas condições, com o intuito de desenvolver a sua rede\nde contatos profissionais, encontrar oportunidades de trabalho, recrutamento, troca de\nconhecimentos, experiências, mensagens, vídeos, fotos, ideias, obter dicas, divulgar produtos, tudo\nisso através de conexões e interações com outros membros, fóruns, páginas, blogs e eventos,\nrelacionados a esportes e áreas correlatas.\n1.2. Esses serviços são realizados por meio da intermediação entre atletas de qualquer modalidade,\nindependentes ou não, a técnicos, faculdades, treinadores, clubes esportivos e empresários do\nramo interessados na promoção, contratação, desenvolvimento, investimento e divulgação de\nnovas oportunidades aos atletas.\n1.3. Os serviços da plataforma são, em sua maioria, oferecidos de forma gratuita aos usuários,\nporém, há opções adicionais de acesso a determinados conteúdos e serviços de forma paga\n(adiante “PLANO PREMIUM” e “PLANO TÉCNICO”) cujos serviços serão de utilização exclusiva\ndos respectivos assinantes. Todos os usuários, sejam eles assinantes ou não dos planos de\nassinatura, submetem-se às regras deste Termos de Uso.\n\n3\n\n1.4. O USUÁRIO RECONHECE QUE O ATLETAS NOW É MERAMENTE UM CANAL DE\nINTERMEDIAÇÃO PARA A APROXIMAÇÃO, LOCALIZAÇÃO, DESENVOLVIMENTO E\nCONTATO ENTRE OS MEMBROS, SEM QUALQUER VÍNCULO COM TÉCNICOS OU ATLETAS.\nO ATLETAS NOW NÃO ASSEGURA A ORIGEM, IDENTIDADE, CONTEÚDO, ANÚNCIOS,\nPERFIS, SERVIÇOS, OU OPORTUNIDADES DIVULGADAS PELOS USUÁRIOS DA REDE SOCIAL\nATLETAS NOW, SENDO TAIS MEMBROS OS RESPONSÁVEIS EXCLUSIVOS PELO MATERIAL E\nINFORMAÇÕES POR ELES DIVULGADAS.\n1.5. O CONTATO ENTRE OS MEMBROS E EVENTUAIS CONTRATAÇÕES SÃO FEITAS\nDIRETAMENTE ENTRE ATLETAS E TÉCNICOS, TODOS INDEPENDENTES E SEM QUALQUER\nVÍNCULO SOCIETÁRIO OU DE SUBORDINAÇÃO COM O ATLETAS NOW, QUE NÃO SE\nRESPONSABILIZA POR QUAISQUER PERDAS, PREJUÍZOS OU DANOS DECORRENTES OU\nRELATIVOS AOS CONTATOS ESTABELECIDOS ATRAVÉS DA PLATAFORMA.\n2. ACEITAÇÃO DOS TERMOS E DISPOSIÇÕES GERAIS\n2.1. ANTES DE UTILIZAR OS SERVIÇOS DO ATLETAS NOW, O USUÁRIO DEVERÁ LER\nATENTAMENTE ESTES TERMOS. AO SE CADASTRAR E UTILIZAR OS SERVIÇOS, O USUÁRIO\nCONFIRMA QUE TERÁ LIDO, ENTENDIDO E ACEITADO TODOS OS TERMOS E CONDIÇÕES\nLISTADOS ABAIXO, ASSIM COMO AS POLÍTICAS DE PRIVACIDADE DO APLICATIVO,\nELABORADAS EM SEPARADO E DISPONÍVEIS NO LINK XXX. CASO, A QUALQUER TEMPO, O\nUSUÁRIO NÃO CONCORDE COM ESSES CONTRATOS, DEVERÁ DEIXAR DE UTILIZAR OS\nSERVIÇOS IMEDIATAMENTE, CANCELAR A SUA CONTA E DESINSTALAR O APLICATIVO.\n2.2. Eventuais “Termos Adicionais” serão devidamente informados aos usuários integrarão este\ncontrato. Em caso de conflito, prevalecerá o disposto nos Termos Adicionais em relação à matéria\nconflitante.\n2.3. O ATLETAS NOW poderá, a qualquer tempo e sem aviso prévio aos usuários, alterar,\nmodificar ou ajustar os Termos. Eventuais modificações que restrinjam os direitos dos usuários ou\nmodifiquem o tratamento de dados pessoais ou informações pessoais sensíveis serão comunicadas\ndevida e oportunamente. Isso não afasta a necessidade de o usuário rever os Termos com\nfrequência, pois se subordinam aos Termos vigentes no momento de seu acesso, uso, envio ou\nobtenção de conteúdo, produtos, promoções, informações, serviços ou ofertas. Caso não concorde,\no usuário deverá cancelar a sua conta, desinstalar o aplicativo e cessar as atividades no ATLETAS\nNOW.\n2.4. COMUNICAÇÕES: O usuário autoriza o ATLETAS NOW a enviar notificações no aplicativo,\nvia e-mail, mensagens de texto (“SMS”), em publicações no site, ou qualquer outro meio, com\n\n4\nconteúdo informativo e promocional relacionado aos serviços e produtos oferecidos. Caso deseje,\no usuário poderá revogar a autorização pelo canal específico da plataforma disponível em XXX.\n3. CADASTRO DO USUÁRIO\n3.1. Para se tornar um membro, cadastrar-se e utilizar a rede social ATLETAS NOW, o usuário deve\nter plena capacidade civil, ser maior de idade conforme a legislação local e/ou ser emancipado, ou\nser menor de 16 (dezesseis) anos, contanto que cadastrado pelos pais e/ou responsáveis legais e\nem respeito às cláusulas 3.3. e 3.4. abaixo; além de concordar que o uso da plataforma será restrito\na objetivos profissionais.\n3.2. O cadastro de instituições, faculdades, clubes esportivos, pessoas jurídicas e associações em\ngeral deverá ser feito por procuradores nomeados, com os devidos poderes de representação para\natuar em nome da empresa/sociedade e se responsabilizarão pelo conteúdo postado e informações\nde cadastro, os quais devem ser lícitos, verdadeiros, corretos e sempre atualizados.\n3.3. MENORES DE DEZESSEIS ANOS: O CADASTRO DE MENORES DE 16 (DEZESSEIS) ANOS\nDEVE SER FEITO PELOS PAIS E/OU RESPONSÁVEIS LEGAIS, após a avaliação e aceitação dos\npresentes termos, por sua conta e risco, responsabilizando-se por quaisquer atos ou\nconsequências relacionadas ao menor e sua conta na rede. CABERÁ AOS PAIS E/OU\nRESPONSÁVEIS LEGAIS A ANÁLISE PRÉVIA DE DADOS PESSOAIS SOLICITADOS EM RELAÇÃO\nA ESSES MENORES, A SUPERVISÃO, ADEQUAÇÃO, GERENCIAMENTO E INSTRUÇÃO SOBRE\nO USO DA REDE SOCIAL E DOS SERVIÇOS OFERECIDOS PELO ATLETAS NOW. ESTAS SÃO\nCONDIÇÕES VITAIS PARA O PRESENTE CONTRATO.\n3.4. O usuário deverá preencher os campos de cadastro solicitados, com informações verídicas,\nsempre atualizadas, corretas e não poderá deixar que terceiros utilizem o seu perfil, nome de\nusuário (“login”) ou senha, pois são dados pessoais, exclusivos e intransferíveis. Caso o usuário\ntenha menos de 16 (dezesseis) anos, a sua conta deverá ser supervisionada pelos pais e/ou\nresponsáveis legais, conforme acordado nestes Termos e nas cláusulas 3.1. e 3.3. acima.\n3.5. Informações falsas, inapropriadas, ilícitas, incompletas ou desatualizadas que violem ou\ncausem danos a direitos de terceiros poderão levar o ATLETAS NOW, sem aviso prévio, a apagar o\nconteúdo postado, suspender e/ou cancelar o contrato e a conta, sem compensação por eventuais\npagamentos ao site, além de recusar futuros acessos pelo usuário.\n3.6. Em nenhuma hipótese, o ATLETAS NOW será responsável por erro, omissão, falsidade,\ninexatidão nas informações disponibilizadas pelo usuário em sua conta e perfil.\n4. SERVIÇOS E UTILIZAÇÃO DO ATLETAS NOW\n\n5\n4.1. Ao utilizar a plataforma ATLETAS NOW e publicar conteúdo, como vídeos, fotos, textos,\ndados e informações pessoais, os usuários concordam com a sua exibição e publicidade, para os\ndemais membros da rede social e usuários da Internet, em consonância com os parâmetros optados\nnas preferências de cadastro, de forma que outros membros da rede poderão contatá-los através\ndessas informações, para o cumprimento dos objetivos da rede social ATLETAS NOW.\n4.2. Para atingir a finalidade da plataforma, o ATLETAS NOW poderá reproduzir, utilizar, adaptar,\npublicar, anunciar, divulgar e traduzir para qualquer idioma, parte ou a integralidade do conteúdo\ne dos dados disponibilizados por seus membros no referido site, em qualquer meio digital,\ninclusive mas não limitado a servidores, hard drives removíveis ou não, \"memory cards”, ou\nqualquer outro suporte tecnológico equivalente, em qualquer formato, por qualquer meio ou\nprocesso, para armazenamento, transmissão ou “download”.\n4.3. O usuário autoriza o ATLETAS NOW a divulgar resultados de recrutamento, aproveitamento e\nseleção de atletas ocorridos por meio da rede social.\n4.4. A autorização do usuário para tal reprodução, utilização, adaptação, publicação e tradução\nservirá para que o ATLETAS NOW distribua conteúdo e dados para tornar essas informações\npúblicas em todo o mundo, nas localidades de sua atuação, através de redes digitais, internet e\noutros meios ou protocolos de comunicação.\n4.5. Uma vez cumpridas as formalidades de cadastro e em conformidade com as responsabilidades\nda cláusula XX, o usuário poderá optar pelo plano grátis ou de assinatura paga da cláusula XX. Ao\nutilizar os serviços da rede social ATLETAS NOW, os membros deverão se atentar, ainda, às\nseguintes regras de publicação, upload, distribuição e disponibilização de conteúdo:\n• comunicação de informações exatas com uso de identidade verdadeira;\n• proibindo-se distribuição de conteúdo, dados e informações falsas, maliciosas, insultante,\nobscena, ofensiva, de caráter violento ou que insulte a violência, xenofóbicas, racistas,\nhomofóbicas, agressivas a terceiros ou que violem a legislação em vigor;\n• cumprir com as leis aplicáveis, respeitar os direitos de terceiros como direitos de\npropriedade intelectual de terceiros (marcas, direitos autorais, etc.), direitos exclusivos\nsobre imagem e voz, proibindo-se a reprodução de conteúdo sem autorização dos titulares,\nobedecendo-se as condições destes Termos de Uso;\n• utilizar o site de forma legítima e específica de de acordo com o seu propósito de\naproximação a oportunidades de crescimento profissional e esportivo;\n• não utilizar softwares robôs ou automatizações tecnológicas equivalentes quando estiver\nnavegando no site ou acessando os seus serviços, e\n• não se utilizar das informações disponíveis na rede para serviços próprios de comunicação\npor spam, envio de e-mails não solicitados, “mass-mailings”, oferecimento ou participação\nde serviços semelhantes a “pirâmides” ou “Marketing Multi Nível” (MMN), publicitários ou\nnão.\n\n6\n\n4.6. Em caso de descumprimento às regras acima, o ATLETAS NOW poderá punir o usuário sem\naviso prévio, apagar o conteúdo postado, suspender e/ou cancelar o contrato e a conta, sem\ncompensação por eventuais pagamentos ao site, além de recusar futuros acessos pelo usuário.\n4.7. Os membros poderão apagar (deletar) a sua conta e perfil no próprio site, na seção específica\npara esse propósito.\n5. RESPONSABILIDADES DO USUÁRIO\n5.1. É de responsabilidade e dever dos usuários a criação de suas respectivas senhas, guardadas sob\nsigilo para preservar a confidencialidade do perfil, devendo reportar imediatamente ao ATLETAS\nNOW eventual uso não autorizado, cabendo aos membros a responsabilidade por perdas daí\nderivadas.\n5.2. As informações da conta do usuário são de sua exclusiva responsabilidade, inclusive em caso\nde danos ou prejuízos a terceiros, violações legais, ilícitos contra propriedade intelectual,\nreproduções indevidas, contrafações, plágio, postagens com conteúdo de caráter difamatório,\ncalunioso, violento, delituoso, obsceno, pornográfico, racista, homofóbico, ilegal ou de qualquer\noutra forma ofensivo.\n5.3. Para as hipóteses do item acima, o ATLETAS NOW estará totalmente isento de acusações ou\nresponsabilizações e se reserva no direito de tomar as medidas cabíveis para resguardar os\ninteresses da plataforma, a integridade de terceiros e demais usuários, sendo certo que poderá\nsuspender ou cancelar a conta do usuário responsável. O ATLETAS NOW poderá, ainda, excluir\nintegral ou parcialmente quaisquer comentários ou conteúdo que julgar inviáveis de publicação.\n6. PRIVACIDADE E USO DE INFORMAÇÕES PESSOAIS IDENTIFICÁVEIS E IDENTIFICADAS DO\nUSUÁRIO\nO ATLETASNOW POSSUI POLÍTICAS ESPECÍFICAS DE PRIVACIDADE DE DADOS PESSOAIS E\nINFORMAÇÕES PESSOAIS SENSÍVEIS DISPONÍVEIS EM XXX. AS INFORMAÇÕES DE REGISTRO\nE DADOS SOBRE O USUÁRIO ESTÃO SUJEITAS A ESSAS POLÍTICAS, AS QUAIS O USUÁRIO\nDECLARA HAVER LIDO, COMPREENDIDO E CONCORDADO. AS POLÍTICAS DE PRIVACIDADE\nREGULAM O USO E A PRESTAÇÃO DE SERVIÇOS REFERENTES À COLETA, TRATAMENTO E\nUTILIZAÇÃO DOS DADOS SOBRE O USUÁRIO, INCLUINDO-SE A TRANSFERÊNCIA DESSAS\nINFORMAÇÕES PARA ARMAZENAMENTO, PROCESSAMENTO E UTILIZAÇÃO POR ATLETAS\nNOW, EMPRESAS PARCEIRAS E DEMAIS EMPRESAS, PARA AS FINALIDADES ESPECÍFICAS DO\nSERVIÇO OFERECIDO E EVENTUAIS UTILIZAÇÕES PRESENTES NA REFERIDA POLÍTICA DE\nPRIVACIDADE QUE CONSTITUI PARTE INTEGRANTE DESTES TERMOS.\n\n7\n\n7. PROPRIEDADE INTELECTUAL\n7.1. As marcas, nomes, logotipos, nomes de domínio, propriedade intelectual em geral e demais\nsinais distintivos, bem como todo e qualquer conteúdo, desenho, arte, identidade visual, layout\npublicados no aplicativo ou site são de propriedade exclusiva do ATLETAS NOW, sendo vedado o\n\nuso sem autorização prévia da plataforma, tampouco a reprodução parcial ou integral, sujeitando-\nse o infrator às medidas judiciais cabíveis, sem prejuízo de eventual indenização por perdas e\n\ndanos e honorários advocatícios ao ATLETAS NOW e a terceiros que venham a sofrer danos pelos\nreferidos atos ilegítimos.\n7.2. São vedados atos ou contribuições tendentes à descompilação, modificação das características,\nampliação, alteração, edição, transformação, distribuição ou incorporação em quaisquer outros\nprogramas, sistemas do aplicativo ou serviço, enfim, qualquer forma de reprodução do aplicativo,\nsoftware, serviço ou produtos oferecidos pelo ATLETAS NOW, total ou parcial, permanente,\ntemporária ou provisória, de forma gratuita ou onerosa, sob quaisquer modalidades, formas ou\ntítulos.\n8. PLANOS E SERVIÇOS DO ATLETAS NOW\n8.1. O ATLETAS NOW oferece diferentes planos de serviço aos usuários de sua plataforma, a\nseguir detalhados:\n(i) PLANO SIMPLES “ATLETAS NOW\" - possibilita o acesso à plataforma digital, conteúdos\ninformativos, comunicação com os técnicos, acesso à lista de clubes esportivos e\nfaculdades, email exclusivo ATLETAS NOW, acompanhamento de todo o processo de\nrecrutamento, promoção direta de perfil para os técnicos,\n(ii) “PLANO PREMIUM” - além dos serviços disponibilizados no plano simples acima, este\nplano PREMIUM possibilita ao usuário uma melhor experiência na plataforma, com\nbenefícios exclusivos e maiores possibilidades, como assessoria personalizada e online;\ncriação de vídeos editados profissionalmente, em número limitado; acesso a palestras e\naulas com ex-atletas e profissionais do esporte; inscrições preferenciais para showcases e\ncamps, além de dicas com orientação educacional e nutricional. Este plano será\ndisponibilizado aos usuários que pagarem o valor mensal de R$ 75,00 (setenta e cinco\nreais), como detalhado na página específica de assinatura, disponibilizada no site.\n(iii) “PLANO TÉCNICO” - Este plano será disponibilizado aos usuários que pagarem o valor\núnico de R$ 500,00 (quinhentos reais), como detalhado na página específica de assinatura.\n8.2. A forma de contratação dos PLANOS mencionados nos itens (ii) e (iii) anteriores serão\nrealizados por meio de um sistema digital a ser anunciado na página específica dessas assinaturas\n\n8\nna plataforma ATLETAS NOW, disponibilizando-se o pagamento através de cartões de crédito,\ncartão de débito ou e/ou boletos bancários.\n8.3. Após a anuência ao PLANO, os serviços da plataforma serão cobrados automaticamente do\nusuário através da modalidade de pagamento por ele definida ao assiná-lo. Recomenda-se que o\nusuário leia os termos e condições próprios do método de pagamento cadastrado.\n8.4. O contrato com o usuário terá validade de um ano e o cancelamento dos PLANOS deverá ser\nfeito, pelo usuário, com um período de aviso prévio de trinta dias para a interrupção definitiva das\ncobranças.\n8.5. O ATLETAS NOW se reserva nos direitos de, a qualquer tempo e sem comunicação prévia,\nmodificar, descontinuar, interromper, modificar, editar, temporária ou permanentemente, os\nserviços e conteúdo oferecidos, inocorrendo violação a direitos do usuário ou implicações de\nresponsabilidades do ATLETAS NOW.\n9. DISPOSIÇÕES FINAIS\n9.1. Em caso de qualquer disposição destes Termos vir a ser considerada inválida, ineficaz ou nula,\npor qualquer órgão competente, as demais permanecerão em pleno vigor para todo e qualquer\nefeito.\n9.2. Eventual tolerância de qualquer das partes a infrações ou descumprimento das condições\nestipuladas nestes Termos será entendida como ato de mera liberalidade, não constituindo\nprecedente, novação ou renúncia a quaisquer direitos assegurados pela legislação ou pelos\npróprios Termos de Uso.\n9.3. As relações e funcionalidades aqui tratadas serão regidas pelas leis brasileiras. Fica eleito o\nforo da Comarca da Capital do Estado de São Paulo como o competente para dirimir eventuais\nlitígios decorrentes da relação contratual.\n9.4. As notificações e intimações dirigidas ao ATLETAS NOW deverão ser enviadas ao endereço\ndescrito de sua sede, constante nestes Termos.','Termos de uso','','inherit','closed','closed','','202-autosave-v1','','','2018-06-21 02:27:45','2018-06-21 05:27:45','',202,'http://54.233.206.85/sem-categoria/202-autosave-v1/',0,'revision','',0),(205,1,'2018-06-21 02:27:49','2018-06-21 05:27:49','<p style=\"text-align: center;\">TERMOS E CONDIÇÕES DE USO\r\nDO SITE ATLETAS NOW</p>\r\n<p style=\"text-align: center;\">Este contrato (adiante “Termos de Uso” ou “Termos”) é celebrado entre ATLETAS NOW\r\nCONSULTORIA E ASSESSORIA ESPORTIVA LTDA., sociedade privada, inscrita no CNPJ sob o no\r\n27.059.681/001-10, com sede na Rua Domingos Fernandes, no 496, apto. 111, sl. 3, Vila Nova\r\nConceição, CEP 04509-011, na cidade de São Paulo, SP, Brasil, titular e controladora do site\r\nwww.atletasnow.com (adiante “aplicativo”, “plataforma”, “site” ou “ATLETAS NOW”) e, de outro\r\nlado, os USUÁRIOS do site ATLETAS NOW (adiante “atletas”, “empresários”, “treinadores”,\r\n“clubes”, “faculdades”, “técnicos”, “membros\"), conforme qualificação por ele informada no\r\nmomento do cadastro de sua conta na referida plataforma.\r\nEstes Termos valem para qualquer acesso ou uso do site, dentro ou fora do Brasil, e regula os\r\nserviços oferecidos pela rede social ATLETAS NOW, ou seja, a relação de intermediação entre\r\natletas e técnicos, faculdades, treinadores, empresários, interessados, membros, inclusive o uso de\r\nferramentas, dados, softwares, áudios, videos, licenças de uso de marca, nome, voz, imagem,\r\nfotografias, material promocional, de marketing, ofertas, eventos, atividades, promoções,\r\ndescontos, entre outros serviços e produtos disponibilizados pela plataforma, sem prejuízo da\r\nexistência de outros Termos, regulamentos e condições de uso específicos (“Termos Adicionais”) a\r\ncada um dos serviços ou produtos a seguir citados.\r\n1. OBJETIVOS DO ATLETAS NOW:\r\n1.1. O ATLETAS NOW é uma rede social esportiva que oferece aos usuários cadastrados uma\r\naplicação tecnológica (plataforma/site/aplicativo) pela qual os membros podem criar e publicar o\r\nseu perfil esportivo online, sob determinadas condições, com o intuito de desenvolver a sua rede\r\nde contatos profissionais, encontrar oportunidades de trabalho, recrutamento, troca de\r\nconhecimentos, experiências, mensagens, vídeos, fotos, ideias, obter dicas, divulgar produtos, tudo\r\nisso através de conexões e interações com outros membros, fóruns, páginas, blogs e eventos,\r\nrelacionados a esportes e áreas correlatas.\r\n1.2. Esses serviços são realizados por meio da intermediação entre atletas de qualquer modalidade,\r\nindependentes ou não, a técnicos, faculdades, treinadores, clubes esportivos e empresários do\r\nramo interessados na promoção, contratação, desenvolvimento, investimento e divulgação de\r\nnovas oportunidades aos atletas.\r\n1.3. Os serviços da plataforma são, em sua maioria, oferecidos de forma gratuita aos usuários,\r\nporém, há opções adicionais de acesso a determinados conteúdos e serviços de forma paga\r\n(adiante “PLANO PREMIUM” e “PLANO TÉCNICO”) cujos serviços serão de utilização exclusiva\r\ndos respectivos assinantes. Todos os usuários, sejam eles assinantes ou não dos planos de\r\nassinatura, submetem-se às regras deste Termos de Uso.</p>\r\n<p style=\"text-align: center;\">3</p>\r\n<p style=\"text-align: center;\">1.4. O USUÁRIO RECONHECE QUE O ATLETAS NOW É MERAMENTE UM CANAL DE\r\nINTERMEDIAÇÃO PARA A APROXIMAÇÃO, LOCALIZAÇÃO, DESENVOLVIMENTO E\r\nCONTATO ENTRE OS MEMBROS, SEM QUALQUER VÍNCULO COM TÉCNICOS OU ATLETAS.\r\nO ATLETAS NOW NÃO ASSEGURA A ORIGEM, IDENTIDADE, CONTEÚDO, ANÚNCIOS,\r\nPERFIS, SERVIÇOS, OU OPORTUNIDADES DIVULGADAS PELOS USUÁRIOS DA REDE SOCIAL\r\nATLETAS NOW, SENDO TAIS MEMBROS OS RESPONSÁVEIS EXCLUSIVOS PELO MATERIAL E\r\nINFORMAÇÕES POR ELES DIVULGADAS.\r\n1.5. O CONTATO ENTRE OS MEMBROS E EVENTUAIS CONTRATAÇÕES SÃO FEITAS\r\nDIRETAMENTE ENTRE ATLETAS E TÉCNICOS, TODOS INDEPENDENTES E SEM QUALQUER\r\nVÍNCULO SOCIETÁRIO OU DE SUBORDINAÇÃO COM O ATLETAS NOW, QUE NÃO SE\r\nRESPONSABILIZA POR QUAISQUER PERDAS, PREJUÍZOS OU DANOS DECORRENTES OU\r\nRELATIVOS AOS CONTATOS ESTABELECIDOS ATRAVÉS DA PLATAFORMA.\r\n2. ACEITAÇÃO DOS TERMOS E DISPOSIÇÕES GERAIS\r\n2.1. ANTES DE UTILIZAR OS SERVIÇOS DO ATLETAS NOW, O USUÁRIO DEVERÁ LER\r\nATENTAMENTE ESTES TERMOS. AO SE CADASTRAR E UTILIZAR OS SERVIÇOS, O USUÁRIO\r\nCONFIRMA QUE TERÁ LIDO, ENTENDIDO E ACEITADO TODOS OS TERMOS E CONDIÇÕES\r\nLISTADOS ABAIXO, ASSIM COMO AS POLÍTICAS DE PRIVACIDADE DO APLICATIVO,\r\nELABORADAS EM SEPARADO E DISPONÍVEIS NO LINK XXX. CASO, A QUALQUER TEMPO, O\r\nUSUÁRIO NÃO CONCORDE COM ESSES CONTRATOS, DEVERÁ DEIXAR DE UTILIZAR OS\r\nSERVIÇOS IMEDIATAMENTE, CANCELAR A SUA CONTA E DESINSTALAR O APLICATIVO.\r\n2.2. Eventuais “Termos Adicionais” serão devidamente informados aos usuários integrarão este\r\ncontrato. Em caso de conflito, prevalecerá o disposto nos Termos Adicionais em relação à matéria\r\nconflitante.\r\n2.3. O ATLETAS NOW poderá, a qualquer tempo e sem aviso prévio aos usuários, alterar,\r\nmodificar ou ajustar os Termos. Eventuais modificações que restrinjam os direitos dos usuários ou\r\nmodifiquem o tratamento de dados pessoais ou informações pessoais sensíveis serão comunicadas\r\ndevida e oportunamente. Isso não afasta a necessidade de o usuário rever os Termos com\r\nfrequência, pois se subordinam aos Termos vigentes no momento de seu acesso, uso, envio ou\r\nobtenção de conteúdo, produtos, promoções, informações, serviços ou ofertas. Caso não concorde,\r\no usuário deverá cancelar a sua conta, desinstalar o aplicativo e cessar as atividades no ATLETAS\r\nNOW.\r\n2.4. COMUNICAÇÕES: O usuário autoriza o ATLETAS NOW a enviar notificações no aplicativo,\r\nvia e-mail, mensagens de texto (“SMS”), em publicações no site, ou qualquer outro meio, com</p>\r\n<p style=\"text-align: center;\">4\r\nconteúdo informativo e promocional relacionado aos serviços e produtos oferecidos. Caso deseje,\r\no usuário poderá revogar a autorização pelo canal específico da plataforma disponível em XXX.\r\n3. CADASTRO DO USUÁRIO\r\n3.1. Para se tornar um membro, cadastrar-se e utilizar a rede social ATLETAS NOW, o usuário deve\r\nter plena capacidade civil, ser maior de idade conforme a legislação local e/ou ser emancipado, ou\r\nser menor de 16 (dezesseis) anos, contanto que cadastrado pelos pais e/ou responsáveis legais e\r\nem respeito às cláusulas 3.3. e 3.4. abaixo; além de concordar que o uso da plataforma será restrito\r\na objetivos profissionais.\r\n3.2. O cadastro de instituições, faculdades, clubes esportivos, pessoas jurídicas e associações em\r\ngeral deverá ser feito por procuradores nomeados, com os devidos poderes de representação para\r\natuar em nome da empresa/sociedade e se responsabilizarão pelo conteúdo postado e informações\r\nde cadastro, os quais devem ser lícitos, verdadeiros, corretos e sempre atualizados.\r\n3.3. MENORES DE DEZESSEIS ANOS: O CADASTRO DE MENORES DE 16 (DEZESSEIS) ANOS\r\nDEVE SER FEITO PELOS PAIS E/OU RESPONSÁVEIS LEGAIS, após a avaliação e aceitação dos\r\npresentes termos, por sua conta e risco, responsabilizando-se por quaisquer atos ou\r\nconsequências relacionadas ao menor e sua conta na rede. CABERÁ AOS PAIS E/OU\r\nRESPONSÁVEIS LEGAIS A ANÁLISE PRÉVIA DE DADOS PESSOAIS SOLICITADOS EM RELAÇÃO\r\nA ESSES MENORES, A SUPERVISÃO, ADEQUAÇÃO, GERENCIAMENTO E INSTRUÇÃO SOBRE\r\nO USO DA REDE SOCIAL E DOS SERVIÇOS OFERECIDOS PELO ATLETAS NOW. ESTAS SÃO\r\nCONDIÇÕES VITAIS PARA O PRESENTE CONTRATO.\r\n3.4. O usuário deverá preencher os campos de cadastro solicitados, com informações verídicas,\r\nsempre atualizadas, corretas e não poderá deixar que terceiros utilizem o seu perfil, nome de\r\nusuário (“login”) ou senha, pois são dados pessoais, exclusivos e intransferíveis. Caso o usuário\r\ntenha menos de 16 (dezesseis) anos, a sua conta deverá ser supervisionada pelos pais e/ou\r\nresponsáveis legais, conforme acordado nestes Termos e nas cláusulas 3.1. e 3.3. acima.\r\n3.5. Informações falsas, inapropriadas, ilícitas, incompletas ou desatualizadas que violem ou\r\ncausem danos