unicação.\r\n4.5. Uma vez cumpridas as formalidades de cadastro e em conformidade com as responsabilidades\r\nda cláusula XX, o usuário poderá optar pelo plano grátis ou de assinatura paga da cláusula XX. Ao\r\nutilizar os serviços da rede social ATLETAS NOW, os membros deverão se atentar, ainda, às\r\nseguintes regras de publicação, upload, distribuição e disponibilização de conteúdo:\r\n• comunicação de informações exatas com uso de identidade verdadeira;\r\n• proibindo-se distribuição de conteúdo, dados e informações falsas, maliciosas, insultante,\r\nobscena, ofensiva, de caráter violento ou que insulte a violência, xenofóbicas, racistas,\r\nhomofóbicas, agressivas a terceiros ou que violem a legislação em vigor;\r\n• cumprir com as leis aplicáveis, respeitar os direitos de terceiros como direitos de\r\npropriedade intelectual de terceiros (marcas, direitos autorais, etc.), direitos exclusivos\r\nsobre imagem e voz, proibindo-se a reprodução de conteúdo sem autorização dos titulares,\r\nobedecendo-se as condições destes Termos de Uso;\r\n• utilizar o site de forma legítima e específica de de acordo com o seu propósito de\r\naproximação a oportunidades de crescimento profissional e esportivo;\r\n• não utilizar softwares robôs ou automatizações tecnológicas equivalentes quando estiver\r\nnavegando no site ou acessando os seus serviços, e\r\n• não se utilizar das informações disponíveis na rede para serviços próprios de comunicação\r\npor spam, envio de e-mails não solicitados, “mass-mailings”, oferecimento ou participação\r\nde serviços semelhantes a “pirâmides” ou “Marketing Multi Nível” (MMN), publicitários ou\r\nnão.</p>\r\n<p style=\"text-align: center;\">6</p>\r\n<p style=\"text-align: center;\">4.6. Em caso de descumprimento às regras acima, o ATLETAS NOW poderá punir o usuário sem\r\naviso prévio, apagar o conteúdo postado, suspender e/ou cancelar o contrato e a conta, sem\r\ncompensação por eventuais pagamentos ao site, além de recusar futuros acessos pelo usuário.\r\n4.7. Os membros poderão apagar (deletar) a sua conta e perfil no próprio site, na seção específica\r\npara esse propósito.\r\n5. RESPONSABILIDADES DO USUÁRIO\r\n5.1. É de responsabilidade e dever dos usuários a criação de suas respectivas senhas, guardadas sob\r\nsigilo para preservar a confidencialidade do perfil, devendo reportar imediatamente ao ATLETAS\r\nNOW eventual uso não autorizado, cabendo aos membros a responsabilidade por perdas daí\r\nderivadas.\r\n5.2. As informações da conta do usuário são de sua exclusiva responsabilidade, inclusive em caso\r\nde danos ou prejuízos a terceiros, violações legais, ilícitos contra propriedade intelectual,\r\nreproduções indevidas, contrafações, plágio, postagens com conteúdo de caráter difamatório,\r\ncalunioso, violento, delituoso, obsceno, pornográfico, racista, homofóbico, ilegal ou de qualquer\r\noutra forma ofensivo.\r\n5.3. Para as hipóteses do item acima, o ATLETAS NOW estará totalmente isento de acusações ou\r\nresponsabilizações e se reserva no direito de tomar as medidas cabíveis para resguardar os\r\ninteresses da plataforma, a integridade de terceiros e demais usuários, sendo certo que poderá\r\nsuspender ou cancelar a conta do usuário responsável. O ATLETAS NOW poderá, ainda, excluir\r\nintegral ou parcialmente quaisquer comentários ou conteúdo que julgar inviáveis de publicação.\r\n6. PRIVACIDADE E USO DE INFORMAÇÕES PESSOAIS IDENTIFICÁVEIS E IDENTIFICADAS DO\r\nUSUÁRIO\r\nO ATLETASNOW POSSUI POLÍTICAS ESPECÍFICAS DE PRIVACIDADE DE DADOS PESSOAIS E\r\nINFORMAÇÕES PESSOAIS SENSÍVEIS DISPONÍVEIS EM XXX. AS INFORMAÇÕES DE REGISTRO\r\nE DADOS SOBRE O USUÁRIO ESTÃO SUJEITAS A ESSAS POLÍTICAS, AS QUAIS O USUÁRIO\r\nDECLARA HAVER LIDO, COMPREENDIDO E CONCORDADO. AS POLÍTICAS DE PRIVACIDADE\r\nREGULAM O USO E A PRESTAÇÃO DE SERVIÇOS REFERENTES À COLETA, TRATAMENTO E\r\nUTILIZAÇÃO DOS DADOS SOBRE O USUÁRIO, INCLUINDO-SE A TRANSFERÊNCIA DESSAS\r\nINFORMAÇÕES PARA ARMAZENAMENTO, PROCESSAMENTO E UTILIZAÇÃO POR ATLETAS\r\nNOW, EMPRESAS PARCEIRAS E DEMAIS EMPRESAS, PARA AS FINALIDADES ESPECÍFICAS DO\r\nSERVIÇO OFERECIDO E EVENTUAIS UTILIZAÇÕES PRESENTES NA REFERIDA POLÍTICA DE\r\nPRIVACIDADE QUE CONSTITUI PARTE INTEGRANTE DESTES TERMOS.</p>\r\n<p style=\"text-align: center;\">7</p>\r\n<p style=\"text-align: center;\">7. PROPRIEDADE INTELECTUAL\r\n7.1. As marcas, nomes, logotipos, nomes de domínio, propriedade intelectual em geral e demais\r\nsinais distintivos, bem como todo e qualquer conteúdo, desenho, arte, identidade visual, layout\r\npublicados no aplicativo ou site são de propriedade exclusiva do ATLETAS NOW, sendo vedado o</p>\r\n<p style=\"text-align: center;\">uso sem autorização prévia da plataforma, tampouco a reprodução parcial ou integral, sujeitando-\r\nse o infrator às medidas judiciais cabíveis, sem prejuízo de eventual indenização por perdas e</p>\r\n<p style=\"text-align: center;\">danos e honorários advocatícios ao ATLETAS NOW e a terceiros que venham a sofrer danos pelos\r\nreferidos atos ilegítimos.\r\n7.2. São vedados atos ou contribuições tendentes à descompilação, modificação das características,\r\nampliação, alteração, edição, transformação, distribuição ou incorporação em quaisquer outros\r\nprogramas, sistemas do aplicativo ou serviço, enfim, qualquer forma de reprodução do aplicativo,\r\nsoftware, serviço ou produtos oferecidos pelo ATLETAS NOW, total ou parcial, permanente,\r\ntemporária ou provisória, de forma gratuita ou onerosa, sob quaisquer modalidades, formas ou\r\ntítulos.\r\n8. PLANOS E SERVIÇOS DO ATLETAS NOW\r\n8.1. O ATLETAS NOW oferece diferentes planos de serviço aos usuários de sua plataforma, a\r\nseguir detalhados:\r\n(i) PLANO SIMPLES “ATLETAS NOW\" - possibilita o acesso à plataforma digital, conteúdos\r\ninformativos, comunicação com os técnicos, acesso à lista de clubes esportivos e\r\nfaculdades, email exclusivo ATLETAS NOW, acompanhamento de todo o processo de\r\nrecrutamento, promoção direta de perfil para os técnicos,\r\n(ii) “PLANO PREMIUM” - além dos serviços disponibilizados no plano simples acima, este\r\nplano PREMIUM possibilita ao usuário uma melhor experiência na plataforma, com\r\nbenefícios exclusivos e maiores possibilidades, como assessoria personalizada e online;\r\ncriação de vídeos editados profissionalmente, em número limitado; acesso a palestras e\r\naulas com ex-atletas e profissionais do esporte; inscrições preferenciais para showcases e\r\ncamps, além de dicas com orientação educacional e nutricional. Este plano será\r\ndisponibilizado aos usuários que pagarem o valor mensal de R$ 75,00 (setenta e cinco\r\nreais), como detalhado na página específica de assinatura, disponibilizada no site.\r\n(iii) “PLANO TÉCNICO” - Este plano será disponibilizado aos usuários que pagarem o valor\r\núnico de R$ 500,00 (quinhentos reais), como detalhado na página específica de assinatura.\r\n8.2. A forma de contratação dos PLANOS mencionados nos itens (ii) e (iii) anteriores serão\r\nrealizados por meio de um sistema digital a ser anunciado na página específica dessas assinaturas</p>\r\n<p style=\"text-align: center;\">8\r\nna plataforma ATLETAS NOW, disponibilizando-se o pagamento através de cartões de crédito,\r\ncartão de débito ou e/ou boletos bancários.\r\n8.3. Após a anuência ao PLANO, os serviços da plataforma serão cobrados automaticamente do\r\nusuário através da modalidade de pagamento por ele definida ao assiná-lo. Recomenda-se que o\r\nusuário leia os termos e condições próprios do método de pagamento cadastrado.\r\n8.4. O contrato com o usuário terá validade de um ano e o cancelamento dos PLANOS deverá ser\r\nfeito, pelo usuário, com um período de aviso prévio de trinta dias para a interrupção definitiva das\r\ncobranças.\r\n8.5. O ATLETAS NOW se reserva nos direitos de, a qualquer tempo e sem comunicação prévia,\r\nmodificar, descontinuar, interromper, modificar, editar, temporária ou permanentemente, os\r\nserviços e conteúdo oferecidos, inocorrendo violação a direitos do usuário ou implicações de\r\nresponsabilidades do ATLETAS NOW.\r\n9. DISPOSIÇÕES FINAIS\r\n9.1. Em caso de qualquer disposição destes Termos vir a ser considerada inválida, ineficaz ou nula,\r\npor qualquer órgão competente, as demais permanecerão em pleno vigor para todo e qualquer\r\nefeito.\r\n9.2. Eventual tolerância de qualquer das partes a infrações ou descumprimento das condições\r\nestipuladas nestes Termos será entendida como ato de mera liberalidade, não constituindo\r\nprecedente, novação ou renúncia a quaisquer direitos assegurados pela legislação ou pelos\r\npróprios Termos de Uso.\r\n9.3. As relações e funcionalidades aqui tratadas serão regidas pelas leis brasileiras. Fica eleito o\r\nforo da Comarca da Capital do Estado de São Paulo como o competente para dirimir eventuais\r\nlitígios decorrentes da relação contratual.\r\n9.4. As notificações e intimações dirigidas ao ATLETAS NOW deverão ser enviadas ao endereço\r\ndescrito de sua sede, constante nestes Termos.</p>','Termos de uso','','inherit','closed','closed','','202-revision-v1','','','2018-06-21 02:27:49','2018-06-21 05:27:49','',202,'http://54.233.206.85/sem-categoria/202-revision-v1/',0,'revision','',0),(208,1,'2018-06-22 00:28:51','2018-06-22 03:28:51','','AtletasNow_LogoPrincipal-01-2','','inherit','open','closed','','atletasnow_logoprincipal-01-2','','','2018-06-22 00:28:51','2018-06-22 03:28:51','',0,'https://atletasnow.com/wp-content/uploads/2018/06/AtletasNow_LogoPrincipal-01-2.png',0,'attachment','image/png',0),(209,1,'2018-06-22 00:37:03','2018-06-22 03:37:03','','atletasnownewlogo','','inherit','open','closed','','atletasnownewlogo','','','2018-06-22 00:37:03','2018-06-22 03:37:03','',0,'https://atletasnow.com/wp-content/uploads/2018/06/atletasnownewlogo.png',0,'attachment','image/png',0),(221,1,'2018-06-25 17:23:33','2018-06-25 20:23:33','<iframe width=\"1383\" height=\"778\" src=\"https://www.youtube.com/embed/GhaD8XLoOl4?feature=oembed\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>','','','publish','closed','closed','','6be226b2ec441cecb7c40e88b89786c7','','','2018-06-25 17:23:33','2018-06-25 20:23:33','',0,'https://atletasnow.com/sem-categoria/6be226b2ec441cecb7c40e88b89786c7/',0,'oembed_cache','',0),(226,1,'2018-06-26 16:37:30','2018-06-26 19:37:30','','Order &ndash; junho 26, 2018 @ 04:37 PM','','wc-cancelled','open','closed','order_5b3295fad4003','order-jun-26-2018-0737-pm','','','2018-06-26 16:37:43','2018-06-26 19:37:43','',0,'https://atletasnow.com/?post_type=shop_order&#038;p=226',0,'shop_order','',2),(227,1,'2018-06-26 16:37:29','2018-06-26 19:37:29','','Subscription &ndash; Jun 26, 2018 @ 07:37 PM','','wc-cancelled','open','closed','order_5b3295fdbccee','subscription-jun-26-2018-0737-pm','','','2018-06-26 16:37:41','2018-06-26 19:37:41','',226,'https://atletasnow.com/?post_type=shop_subscription&#038;p=227',0,'shop_subscription','',1),(228,1,'2018-06-26 16:38:13','2018-06-26 19:38:13','','Order &ndash; junho 26, 2018 @ 04:38 PM','','wc-cancelled','open','closed','order_5b3296250d486','order-jun-26-2018-0738-pm','','','2018-06-26 16:38:26','2018-06-26 19:38:26','',0,'https://atletasnow.com/?post_type=shop_order&#038;p=228',0,'shop_order','',2),(229,1,'2018-06-26 16:38:11','2018-06-26 19:38:11','','Subscription &ndash; Jun 26, 2018 @ 07:38 PM','','wc-cancelled','open','closed','order_5b3296279a3da','subscription-jun-26-2018-0738-pm','','','2018-06-26 16:38:24','2018-06-26 19:38:24','',228,'https://atletasnow.com/?post_type=shop_subscription&#038;p=229',0,'shop_subscription','',1),(233,1,'2018-06-27 09:59:24','2018-06-27 12:59:24','Os Gadgets chegaram com tudo na vida dos atletas para auxiliar a prática das atividades físicas, acompanhar o desempenho, ajudar no acompanhamento da nossa saúde sem atrapalhar ou fazer algum peso desnecessário que atrapalhe a prática de atividades.\r\nA AtletasNow quer que você esteja sempre em alto nível, então separamos uma lista de aparelhos que podem te ajudar:\r\n\r\n<strong>  </strong>\r\n\r\n<strong>SmartWhatch: </strong>\r\n\r\nApple, Samsung, Sony e outras gigantes do segmento possuem relógios capazes de monitor seus batimentos cardíacos, GPS, podem marcar a distância percorrida ao longo da atividade, quantidade de calorias perdidas e podem monitora a quantidade de calorias perdidas. Além, claro, da conectividade com seu celular e com Apps de outras marcas.\r\n\r\n<strong>\r\nBraçadeira Esportiva:\r\n\r\n</strong>Se você opta apenas por seu Smartphone e fones para te acompanharem ao longo do exercício, esse equipamento pode ser uma boa edição para você. A braçadeira posso ajuste uma alça ajustável, protege seu aparelho, possuem porta fones nas laterais e fácil acesso para tela inicial do aparelho.\r\n\r\n\r\n<strong>SmartBands:\r\n\r\n\r\n</strong>Pode não parecer, mas elas são diferentes dos SmartWatches citados acima. Diferente dos relógios, elas foram desenvolvidas diretamente para o mundo Fitness não possuindo um visor para atender chamadas ou responder mensagens. Suas funções ficam direcionadas para o monitoramento, possuem uma bateria mais duradoura e custo benefício mais acessível.\r\n\r\n\r\n<strong>Fone de ouvido via Bluetooth: </strong>\r\n\r\n<strong> </strong>\r\n\r\nA música não pode ficar fora da sua atividade e você já deve saber qual o ritmo certo para te acompanhar. Geralmente os fones comuns não possuem um Design voltado à prática de exercícios físicos podendo atrapalhar em certos momentos. A melhor solução é optar por fones com tecnologia Bluetooth desenvolvidos para auxiliar atletas. JBL, Samsung, Pulse, Phillips são marcas que possuem essa linha de produtos com funções interessantes como isolamento de ruído, resistência ao suor, materiais resistentes e de alta qualidade.\r\n\r\n\r\nVocê já utilizou algum desses equipamentos ou gostaria de recomendar algum? Conte para nós qual seu favorito e como ele te ajuda na sua rotina de exercícios. Fale conosco através das nossas redes sociais!\r\n\r\n<strong> </strong>\r\n\r\n<strong> </strong>','Os melhores gadgets para te auxiliar na sua rotina de exercícios.','','publish','closed','closed','','os-melhores-gadgets-para-te-auxiliar-na-sua-rotina-de-exercicios','','','2018-06-27 09:59:24','2018-06-27 12:59:24','',0,'https://atletasnow.com/?post_type=aprenda&#038;p=233',0,'aprenda','',0),(234,1,'2018-06-27 10:03:51','2018-06-27 13:03:51','Entre os grandes eventos esportivos do mundo, temos as paraolimpíadas que são um sucesso em todas as edições com atletas competindo no seu mais alto nível e cheios de orgulho em representar seu país ao longo da competição.\r\n\r\nAntes de se firmar como uma competição, a história dos jogos começa em 1943, na pequena cidade Inglesa Stoke Mandeville, quando o neurologista Ludwig Guttman recebeu a importante missão de reabilitar soldados que vieram da Segunda Guerra Mundial. Como uma solução para ajudar esses soldados, Guttman montou um tratamento que uniu trabalho com esportes como basquetebol, tiro com arco, dardo e bilhar.\r\n\r\nEm 1948, ele promoveu o primeiro evento esportivo voltado para portadores deficiência após o sucesso do tratamento. Os jogos voltados para esses atletas continuaram todos os anos seguintes se tornando um evento internacional no ano de 1952.\r\n\r\nEm 1960, na cidade de Roma, ocorreram os primeiros jogos no estilo olímpico para atletas com deficiência.\r\nAtualmente, a competição representa uma disputa com atletas do mais alto nível competindo em 23 modalidades.\r\n\r\n&nbsp;\r\n\r\nCom todo esse potencial esportivo, nós da Atletas Now, não podíamos ficar de fora! Para isso, estamos cada vez querendo adicionar mais e mais esportes, desse modo os esportes paraolímpicos já estão sendo desenvolvidos para ser englobados em nossa rede!\r\n\r\n&nbsp;\r\n\r\n#ATLETASNOWSUAHORAÉAGORA','História dos jogos Paraolímpicos','','publish','closed','closed','','historia-dos-jogos-paraolimpicos','','','2018-06-27 10:03:51','2018-06-27 13:03:51','',0,'https://atletasnow.com/?post_type=aprenda&#038;p=234',0,'aprenda','',0),(235,1,'2018-06-27 10:03:49','2018-06-27 13:03:49','','Order &ndash; junho 27, 2018 @ 10:03 AM','','wc-cancelled','open','closed','order_5b338b353d02f','order-jun-27-2018-0103-pm','','','2018-06-27 10:04:09','2018-06-27 13:04:09','',0,'https://atletasnow.com/?post_type=shop_order&#038;p=235',0,'shop_order','',2),(236,1,'2018-06-27 10:03:48','2018-06-27 13:03:48','','Subscription &ndash; Jun 27, 2018 @ 01:03 PM','','wc-cancelled','open','closed','order_5b338b3b8e419','subscription-jun-27-2018-0103-pm','','','2018-06-27 10:04:04','2018-06-27 13:04:04','',235,'https://atletasnow.com/?post_type=shop_subscription&#038;p=236',0,'shop_subscription','',1),(237,1,'2018-06-27 10:04:25','2018-06-27 13:04:25','','Order &ndash; junho 27, 2018 @ 10:04 AM','','wc-cancelled','open','closed','order_5b338b59e1a8a','order-jun-27-2018-0104-pm','','','2018-06-27 10:04:50','2018-06-27 13:04:50','',0,'https://atletasnow.com/?post_type=shop_order&#038;p=237',0,'shop_order','',2),(238,1,'2018-06-27 10:04:23','2018-06-27 13:04:23','','Subscription &ndash; Jun 27, 2018 @ 01:04 PM','','wc-cancelled','open','closed','order_5b338b608efce','subscription-jun-27-2018-0104-pm','','','2018-06-27 10:04:44','2018-06-27 13:04:44','',237,'https://atletasnow.com/?post_type=shop_subscription&#038;p=238',0,'shop_subscription','',1),(239,1,'2018-06-27 10:09:24','2018-06-27 13:09:24','<p style=\"text-align: left;\"><strong>Guilherme Paraense:\r\n</strong>\r\nVocê conhece a história do atleta Guilherme Paraense?</p>\r\n<p style=\"text-align: left;\">Talvez esse nome seja desconhecido para você, mas Guilherme foi o primeiro brasileiro a conquistar uma medalha de ouro para nosso país.</p>\r\n<p style=\"text-align: left;\">O atleta nasceu em Belém do Pará, no dia 25 de junho de 1884. Com apenas 5 anos de idade, foi para o Rio de Janeiro e começou a frequentar a Escola Militar de Realengo.</p>\r\n<p style=\"text-align: left;\">O tiro estava entre os exercícios exigidos nas suas atividades como militar e sempre teve facilidade nesse exercício acertando alvos de diferentes formatos e tamanhos.</p>\r\n<p style=\"text-align: left;\">\r\nSeu talento lhe rendeu o campeonato Brasileiro e Sulamericano na modalidade tiro com revolver.\r\nEm 1920, a delegação viajou até Bruxelas para competirem nos jogos daquele ano. A prova consistia em 30 tiros a uma distância de 30 metrôs do alvo e Guilherme acertou os três últimos que foram determinantes para a decisão. Paraense fez 274 pontos de 300, faturando, pela primeira vez, o lugar mais alto do pódio para nosso país.</p>\r\n<p style=\"text-align: left;\">Se hoje nosso país possui uma safra de campeões, Guilherme Paraense teve uma grande contribuição para o início da nossa história como campeões.</p>\r\n&nbsp;\r\n\r\nAssim como Guilherme no passado, muitos atletas atualmente sofrem com a mesma falta de atenção de divulgação e mídia. Atletas Now chegou para mudar essa realidade e ajudar a explorar o inexplorado!\r\n\r\n&nbsp;\r\n\r\n#ATLETASNOWSUAHORAÉAGORA\r\n\r\n&nbsp;\r\n<p style=\"text-align: left;\"></p>','Pouca Mídia, Muito Talento!','','publish','closed','closed','','pouca-midia-muito-talento','','','2018-07-04 16:27:32','2018-07-04 19:27:32','',0,'https://atletasnow.com/?post_type=aprenda&#038;p=239',0,'aprenda','',0),(240,1,'2018-06-27 10:07:13','2018-06-27 13:07:13','','Order &ndash; junho 27, 2018 @ 10:07 AM','','wc-cancelled','open','closed','order_5b338c01b6445','order-jun-27-2018-0107-pm','','','2018-06-27 10:07:28','2018-06-27 13:07:28','',0,'https://atletasnow.com/?post_type=shop_order&#038;p=240',0,'shop_order','',2),(241,1,'2018-06-27 10:07:11','2018-06-27 13:07:11','','Subscription &ndash; Jun 27, 2018 @ 01:07 PM','','wc-cancelled','open','closed','order_5b338c04efa09','subscription-jun-27-2018-0107-pm','','','2018-06-27 10:07:23','2018-06-27 13:07:23','',240,'https://atletasnow.com/?post_type=shop_subscription&#038;p=241',0,'shop_subscription','',1),(243,1,'2018-06-28 16:35:54','2018-06-28 19:35:54','Organizada pelo COI (Comitê Olímpico Internacional), os primeiros jogos de inverno aconteceram em 1924, na cidade de Chamonix, na França com a participação de 258 atletas de 16 países diferentes, entre eles 247 homens e 11 mulheres.\r\n\r\nPor algum tempo, os jogos de verão e inverno eram realizados no mesmo país, mas com os ventos da Segunda Guerra Mundial, duas edições foram canceladas e somente após o término desses eventos, os jogos eram realizados em sedes diferentes, porém no mesmo ano.\r\n\r\nEm 1986, as Olímpiadas de verão e inverno passaram a acontecer de forma intercalada, com uma pausa de dois anos entre as duas competições.\r\n\r\nA primeira participação do Brasil ocorreu nos jogos de 1992, na França. Nosso comitê contou com 7 atletas, todos atuando pela modalidade do Esqui Alpino. Desde então, o Brasil vem aumentando sua participação e na última edição conto com 9 atletas. Aparentemente, nosso país tropical começou a desbravar cada vez mais lugares gelados.\r\n\r\n&nbsp;','História dos jogos de inverno','','publish','closed','closed','','historia-dos-jogos-de-inverno','','','2018-06-28 16:35:54','2018-06-28 19:35:54','',0,'https://atletasnow.com/?post_type=aprenda&#038;p=243',0,'aprenda','',0),(244,1,'2018-06-28 16:38:28','2018-06-28 19:38:28','O que antes era considerado apenas diversão ou entretenimento, hoje conta com campeonatos de elite espalhados por todo o globo, jogadores de alto nível e grandes quantias de premiações.\r\nOs campeonatos de jogos eletrônicos ganharam destaque abrindo espaço na grade de grandes emissoras.\r\n\r\nA TV Globo possui o programa Zero1, comandado por Tiago Leifert, o apresentador recebe convidados especiais para analisar os principais eventos do mundo dos games e repercutir os campeonatos de “esports”. O canal Esporte Interativo, dedica um tempo para o mesmo assunto com o EI Games não somente em seu canal por assinatura, mas também em mídias como Twitter e principalmente Youtube, assim como o site dos canais ESPN que possuem transmissões e uma sessão exclusiva sobre o tema em seu site.\r\n\r\nTalvez você possa argumentar dizendo que não existe grande esforço físico para competir na modalidade e ser considerado esporte, mas com equipes cada vez mais qualificadas que representam nosso país em nível global, esteja na hora de rever seus conceitos e apoiar esses atletas.\r\n\r\nPensando nesses competidores, a AtletasNow já possui seu espaço para Gamers adicionarem seu perfil.\r\n\r\n&nbsp;\r\n\r\n#ATLETASNOWSUAHORAÉAGORA','Videogame é esporte sim!','','publish','closed','closed','','videogame-e-esporte-sim','','','2018-06-28 16:38:28','2018-06-28 19:38:28','',0,'https://atletasnow.com/?post_type=aprenda&#038;p=244',0,'aprenda','',0),(253,1,'2018-07-05 00:38:59','2018-07-05 03:38:59','','Order &ndash; julho 5, 2018 @ 12:38 AM','','wc-cancelled','open','closed','order_5b3d92d3eb03e','order-jul-05-2018-0338-am','','','2018-07-05 00:39:14','2018-07-05 03:39:14','',0,'https://atletasnow.com/app/?post_type=shop_order&#038;p=253',0,'shop_order','',2),(254,1,'2018-07-05 00:38:59','2018-07-05 03:38:59','','Subscription &ndash; Jul 05, 2018 @ 03:39 AM','','wc-cancelled','open','closed','order_5b3d92d79e2e5','subscription-jul-05-2018-0339-am','','','2018-07-05 00:39:12','2018-07-05 03:39:12','',253,'https://atletasnow.com/app/?post_type=shop_subscription&#038;p=254',0,'shop_subscription','',1),(255,1,'2018-07-05 00:42:44','2018-07-05 03:42:44','','Order &ndash; julho 5, 2018 @ 12:42 AM','','wc-cancelled','open','closed','order_5b3d93b463744','order-jul-05-2018-0342-am','','','2018-07-05 00:42:58','2018-07-05 03:42:58','',0,'https://atletasnow.com/app/?post_type=shop_order&#038;p=255',0,'shop_order','',2),(256,1,'2018-07-05 00:42:43','2018-07-05 03:42:43','','Subscription &ndash; Jul 05, 2018 @ 03:42 AM','','wc-cancelled','open','closed','order_5b3d93b777a7e','subscription-jul-05-2018-0342-am','','','2018-07-05 00:42:55','2018-07-05 03:42:55','',255,'https://atletasnow