18-07-10 18:29:40','',271,'https://atletasnow.com/app/?post_type=shop_subscription&#038;p=272',0,'shop_subscription','',1),(273,1,'2018-07-10 16:38:37','2018-07-10 19:38:37','O que passa na cabeça dos atletas?\r\n\r\nO TED TALK é uma série de conferências, sem fins lucrativos, que possui o intuito de espalhar e debater ideias. Os temas são os mais variados possíveis, sempre contanto com a presença de algum profissional que seja referência no assunto debatido.\r\nNo vídeo que separamos, o psicólogo Martin Hagger explica ao longo da conversa, técnicas que atletas e técnicos utilizam para se preparem psicologicamente antes de competirem para atingirem grandes performances.\r\n\r\nhttps://www.youtube.com/watch?v=yG7v4y_xwzQ\r\n\r\n&nbsp;\r\n\r\n<strong>Fonte: </strong>Canal – TED X TALKS\r\nOrador – Martin Hagger <strong>\r\n</strong>Tradução: Brescia Terra\r\nRevisão: Pedro Reis\r\n\r\n<strong>\r\n\r\n\r\n</strong>\r\n\r\n&nbsp;','Na Cabeça dos Campeões','','publish','closed','closed','','na-cabeca-dos-campeoes','','','2018-07-10 16:39:17','2018-07-10 19:39:17','',0,'https://atletasnow.com/app/?post_type=aprenda&#038;p=273',0,'aprenda','',0),(274,1,'2018-07-10 16:38:44','2018-07-10 19:38:44','<iframe width=\"846\" height=\"476\" src=\"https://www.youtube.com/embed/yG7v4y_xwzQ?feature=oembed\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>','','','publish','closed','closed','','efb865fbe049e5a6f70f99c93b09d577','','','2018-07-10 16:38:44','2018-07-10 19:38:44','',0,'https://atletasnow.com/app/sem-categoria/efb865fbe049e5a6f70f99c93b09d577/',0,'oembed_cache','',0),(275,1,'2018-07-10 17:19:36','2018-07-10 20:19:36','','Order &ndash; julho 10, 2018 @ 05:19 PM','','wc-cancelled','open','closed','order_5b4514d8219f3','order-jul-10-2018-0819-pm','','','2018-07-10 17:19:50','2018-07-10 20:19:50','',0,'https://atletasnow.com/app/?post_type=shop_order&#038;p=275',0,'shop_order','',2),(276,1,'2018-07-10 17:19:35','2018-07-10 20:19:35','','Subscription &ndash; Jul 10, 2018 @ 08:19 PM','','wc-cancelled','open','closed','order_5b4514daea0e2','subscription-jul-10-2018-0819-pm','','','2018-07-10 17:19:48','2018-07-10 20:19:48','',275,'https://atletasnow.com/app/?post_type=shop_subscription&#038;p=276',0,'shop_subscription','',1),(279,1,'2018-07-12 14:16:31','2018-07-12 17:16:31','Antes do Jogos Olímpicos começarem, a Tocha Olímpica precisa ser acesa para oficializar o início da competição. A Chama percorre um grande trajeto passando por cidades e pelas mãos de convidados que vão conduzi-la até seu destino.\r\nOs Jogos Olímpicos começaram na cidade de Olímpia, na Grécia antiga, por isso, receberam este nome. Os Gregos consideravam o fogo como algo divino, então acendiam chamas nas portas dos templos e, na naquela época, mensageiros percorriam cidades para anunciar que a data de início da competição estava se aproximando. Além disso, os Jogos marcavam um período de paz entre os povos.\r\nEsses acontecimentos marcaram o que podemos chamar de “Jogos Olímpicos da Antiguidade” explicando suas origens e tradições. Na era moderna, na cidade de Amsterdã, em 1928, foi a primeira edição a ter uma Pira Olímpica acesa em um dos seus estádios. Na edição de Berlim, em 1936, foi realizado o primeiro revezamento da Tocha Olímpica que percorreu sete países antes de chegar na cidade que recebeu os Jogos naquele ano.\r\nAo longo do tempo, a Tocha recebeu algumas modificações no seu design para não apagar ao longo do caminho, independente da condição climática. Mas, ela nunca perdeu seu real significado, ou seja, simbolizar o espírito de paz ao longo da competição.\r\n\r\nNós da AtletasNow, acreditamos que o esporte, de fato, é capaz de conectar diferentes culturas e queremos que o espírito esportivo esteja cada vez mais presente em todos os lugares para qualquer modalidade esportiva.','A Tocha Olímpica e seu verdadeiro significado.','','publish','closed','closed','','a-tocha-olimpica-e-seu-verdadeiro-significado','','','2018-07-12 14:16:31','2018-07-12 17:16:31','',0,'https://atletasnow.com/app/?post_type=aprenda&#038;p=279',0,'aprenda','',0),(280,1,'2018-07-12 17:02:12','2018-07-12 20:02:12','Gustavo Kuerten, mais conhecido como Guga, sem dúvidas é uma inspiração para todos os esportistas. Além de uma trajetória vitoriosa, seu carisma e palavras podem contagiar uma arena inteira.\r\nSeparamos uma palestra do grande jogador na qual ele conta os bastidores das suas competições e muitas histórias pessoais capaz de despertar o espirito campeão de qualquer pessoa.\r\n\r\nhttps://www.youtube.com/watch?v=e-t8Gtq7Jr8\r\n\r\nFonte: Canal: Canal Oficial Guga Kuerten\r\nOrador: Guga\r\nOnde: Palestra Endeavor.','Bastidores do sucesso.','','publish','closed','closed','','bastidores-do-sucesso','','','2018-07-12 17:02:37','2018-07-12 20:02:37','',0,'https://atletasnow.com/app/?post_type=aprenda&#038;p=280',0,'aprenda','',0),(281,1,'2018-07-12 17:02:20','2018-07-12 20:02:20','<iframe width=\"846\" height=\"476\" src=\"https://www.youtube.com/embed/e-t8Gtq7Jr8?feature=oembed\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>','','','publish','closed','closed','','15cc3d43a8f2e3cca6db112fcdb1449c','','','2018-07-12 17:02:20','2018-07-12 20:02:20','',0,'https://atletasnow.com/app/sem-categoria/15cc3d43a8f2e3cca6db112fcdb1449c/',0,'oembed_cache','',0),(283,1,'2018-07-13 14:50:41','0000-00-00 00:00:00','','Catálogo Esportivo','','draft','closed','closed','','','','','2018-07-13 14:50:41','2018-07-13 17:50:41','',0,'https://atletasnow.com/app/?post_type=aprenda&#038;p=283',0,'aprenda','',0),(284,1,'2018-07-13 15:05:21','2018-07-13 18:05:21','Sabemos que o catálogo da Netflix possui uma grande variedade de conteúdos capaz de deixar qualquer um confuso do que assistir com tantas opções. Para te ajudar, a equipe da AtletasNOW separou os melhores conteúdos esportivos para todo fã do esporte “maratonar” e se divertir. Agora, prepare a pipoca e acompanhe a lista:\r\n<ul>\r\n 	<li><strong> Eu sou Bolt:</strong> O documentário acompanha a puxada rotina de treinos do campeão e recordista olímpico, Usain Bolt. O material também conta com imagens, entrevistas e curiosidades sobre os bastidores da carreira do velocista.</li>\r\n 	<li><strong>Becoming Zlatan: </strong>Goleador, polêmico e campeão por onde passou, esse documentário acompanha os primeiros chutes até o sucesso mundial do craque Sueco, Zlatan Ibrahimovic. Se você admira o futebol do gigante jogador, essa opção não pode faltar na sua lista.</li>\r\n 	<li><strong>#Rucker50 – Gigantes do Basquete: </strong>Para os fãs do basquete, esse documentário celebra os 50 anos do programa esportivo do Harlem que transformou diversos jovens de Nova York em jogadores profissionais.</li>\r\n 	<li><b><strong>Senna: O Brasileiro. O herói. O campeão: </strong></b>Mais que um piloto de Fórmula 1, podemos dizer que Ayrton Senna é um ídolo nacional que marcou gerações não somente dentro como fora das pistas. Com esse premiado documentário, podemos matar um pouco a saudade do grande corredor.</li>\r\n 	<li><strong>Motivation 3: The Next Generation:  </strong>Voltado para os esportes radicais, o documentário acompanha a vida de quatro Skatistas que competem pelo prêmio de suas vidas no Tampa Am 2016.</li>\r\n 	<li><strong>Last Chance U:</strong> A série documental acompanha a vida de jovens jogadores do futebol americano que buscam conquistar seu espaço nesse esporte tão concorrido.</li>\r\n</ul>\r\nGostou da nossa lista? Comente o que achou das nossas recomendações. Se quiser sugerir outro material, comente em nossas redes sociais.\r\n\r\n&nbsp;','Catálogo Esportivo','','publish','closed','closed','','catalogo-esportivo','','','2018-07-13 15:20:30','2018-07-13 18:20:30','',0,'https://atletasnow.com/app/?post_type=aprenda&#038;p=284',0,'aprenda','',0),(285,1,'2018-07-13 15:13:49','2018-07-13 18:13:49','Sabemos que o catálogo da Netflix possui uma grande variedade de conteúdos capaz de deixar qualquer um confuso do q