,0),(287,1,'2018-07-13 16:41:27','2018-07-13 19:41:27','O final de semana está chegando, mas o esporte nunca tira folga! Para você não perder nada, separamos o que de mais legal vai rolar entre sábado e domingo. Se liga:\r\n\r\n&nbsp;\r\n\r\n<strong>Final da Copa: </strong>Infelizmente, a Copa do Mundo chegou na sua reta final. Sábado teremos a decisão do terceiro lugar entre Bélgica e Inglaterra e, no domingo, a grande decisão entre França e Croácia.\r\n\r\nBélgica X Inglaterra:\r\n\r\nRede Globo – 11h – 14/ JUL\r\n\r\nSPORTV – 11h – 14/JUL\r\n\r\nFoxSports – 11h – 14/JUL\r\n\r\n&nbsp;\r\n\r\nFrança x Croácia:\r\n\r\n&nbsp;\r\n\r\nRede Globo – 11h – 15/ JUL\r\n\r\nSPORTV – 11h – 15/ JUL\r\n\r\nFoxSports – 11h – 15/ JUL\r\n\r\n&nbsp;\r\n\r\nOficialmente, o último jogo vai começar às 12h (Horário de Brasília), mas as emissoras vão começar a transmissão antes da bola rolar. Desejamos muita diversão e bom futebol para todos que vão acompanhar aos dois últimos da Copa do Mundo, independente da torcida.\r\n\r\n<strong>Velocidade máxima: </strong>Para os amantes da velocidade, no sábado, também não vai faltar opção porque teremos o Mundial de Motovelocidade:\r\n\r\n&nbsp;\r\n\r\nMundial de Motovelocidade: Treino Oficial MOTO 3 – Alemanha\r\n\r\nSPORTV 2 – 07h15 – 14/ JUL\r\n\r\n&nbsp;\r\n\r\nMundial de Motovelocidade: Treino Oficial MOTO GP – Alemanha\r\n\r\nSPORTV 2 – 08h30 – 14/ JUL\r\n\r\n&nbsp;\r\n\r\nMundial de Motovelocidade: Treino Oficial MOTO 2 – Alemanha\r\n\r\nSPORTV 2 – 10h05 – 14/ JUL\r\n\r\n&nbsp;\r\n\r\n<strong>Tênis:</strong> o tradicional torneio de Wimbledon terá uma emocionante final na categoria simples masculina.\r\n\r\n&nbsp;\r\n\r\nWimbledon – Finais\r\nFinal: Simples Masculina\r\n\r\nSPORTV 3 – 10h – 15/JUL\r\n\r\n<strong>NBA SUMMER LEAGUE: </strong>O campeonato que serve para os times da maior liga de basquete do mundo testarem seus jovens jogadores e preencheram as vagas que estão faltando no time já começou. Não deixe de conferir:\r\n\r\nESPN Extra – 19h30 – 14/07 JUL\r\n\r\nESPN Extra – 21h30 – 14/07 JUL\r\n&nbsp;','O esporte NUNCA descansa!','','publish','closed','closed','','o-esporte-nunca-descansa','','','2018-07-13 16:41:27','2018-07-13 19:41:27','',0,'https://atletasnow.com/app/?post_type=aprenda&#038;p=287',0,'aprenda','',0),(290,112,'2018-07-15 16:56:21','2018-07-15 19:56:21','','IMG-20180613-WA0040','','inherit','open','closed','','img-20180613-wa0040','','','2018-07-15 16:56:21','2018-07-15 19:56:21','',0,'https://atletasnow.com/app/wp-content/uploads/2018/07/IMG-20180613-WA0040.jpg',0,'attachment','image/jpeg',0),(291,111,'2018-07-15 18:27:10','2018-07-15 21:27:10','','unnamed-14','','inherit','open','closed','','unnamed-14','','','2018-07-15 18:27:10','2018-07-15 21:27:10','',0,'https://atletasnow.com/app/wp-content/uploads/2018/07/unnamed-14.jpg',0,'attachment','image/jpeg',0),(293,1,'2018-07-16 12:05:46','2018-07-16 15:05:46','','Order &ndash; julho 16, 2018 @ 12:05 PM','','wc-cancelled','open','closed','order_5b4cb44ae05e1','order-jul-16-2018-0305-pm','','','2018-07-16 12:06:00','2018-07-16 15:06:00','',0,'https://atletasnow.com/app/?post_type=shop_order&#038;p=293',0,'shop_order','',2),(294,1,'2018-07-16 12:05:45','2018-07-16 15:05:45','','Subscription &ndash; Jul 16, 2018 @ 03:05 PM','','wc-cancelled','open','closed','order_5b4cb44e1cc09','subscription-jul-16-2018-0305-pm','','','2018-07-16 12:05:58','2018-07-16 15:05:58','',293,'https://atletasnow.com/app/?post_type=shop_subscription&#038;p=294',0,'shop_subscription','',1),(295,1,'2018-07-16 12:07:34','2018-07-16 15:07:34','','Order &ndash; julho 16, 2018 @ 12:07 PM','','wc-cancelled','open','closed','order_5b4cb4b65ec3a','order-jul-16-2018-0307-pm','','','2018-07-16 12:07:45','2018-07-16 15:07:45','',0,'https://atletasnow.com/app/?post_type=shop_order&#038;p=295',0,'shop_order','',2),(296,1,'2018-07-16 12:07:33','2018-07-16 15:07:33','','Subscription &ndash; Jul 16, 2018 @ 03:07 PM','','wc-cancelled','open','closed','order_5b4cb4b95e8f1','subscription-jul-16-2018-0307-pm','','','2018-07-16 12:07:43','2018-07-16 15:07:43','',295,'https://atletasnow.com/app/?post_type=shop_subscription&#038;p=296',0,'shop_subscription','',1),(297,1,'2018-07-16 12:38:49','2018-07-16 15:38:49','','Order &ndash; julho 16, 2018 @ 12:38 PM','','wc-cancelled','open','closed','order_5b4cbc09e5df7','order-jul-16-2018-0338-pm','','','2018-07-16 12:39:02','2018-07-16 15:39:02','',0,'https://atletasnow.com/app/?post_type=shop_order&#038;p=297',0,'shop_order','',2),(298,1,'2018-07-16 12:38:48','2018-07-16 15:38:48','','Subscription &ndash; Jul 16, 2018 @ 03:38 PM','','wc-cancelled','open','closed','order_5b4cbc0cbe01b','subscription-jul-16-2018-0338-pm','','','2018-07-16 12:38:59','2018-07-16 15:38:59','',297,'https://atletasnow.com/app/?post_type=shop_subscription&#038;p=298',0,'shop_subscription','',1),(300,1,'2018-07-16 15:15:07','2018-07-16 18:15:07','Daniel Dias:\r\n\r\n&nbsp;\r\n\r\nEntre as raias de uma piscina, é onde nosso maior atleta Paralímpico, Daniel Dias, costuma esbanjar seu talento.\r\nDaniel de Faria Dias nasceu no dia 24 de maio de 1988 com uma má formação Congênita nos braços e na perna direita. Desde pequeno, o nadador sempre possuiu interesse por esportes e gostava de praticar alguma atividade física na época da escola. Porém, foi em 2004, nos Jogos Paralímpicos de Atenas, que surgiu o sonho de representar seu país quando viu outro atleta, Clodoaldo Silva, brilhar nas águas e levar seis medalhas de ouro. Nessa edição, Daniel pôde conhecer e se interessar pela modalidade dando início na sua trajetória como atleta.\r\nNo ano de 2006, ele participou da sua primeira competição oficial e de cara faturou duas medalhas de bronze, mas foi no final do ano, na África do Sul, onde o atleta conquistou o lugar mais alto do pódio.\r\nEm 2008, nos Jogos de Pequim, Daniel fez sua estreia nos Jogos competindo nas categorias S5, SB4 e SM5 fechando a competição com quatro medalhas de ouro, quatro pratas e um bronze. Na edição seguinte, em Londres, ele obteve sucesso em todas modalidades que participou faturando incríveis seis medalhas de ouro.\r\nNos jogos do Rio de Janeiro, em 2016, Daniel chegou na competição somando quinze medalhas no currículo, o que já podemos considerar algo impressionante. Mas, o campeão nunca parou de nos surpreender e terminou a competição com quatro medalhas de ouro, três de prata e duas de bronze, somando vinte e quatro medalhas na carreira.\r\nAtualmente, Daniel continua escrevendo sua história competindo em diversas competições, além de realizar palestras sobre superação e propagar o esporte Paralímpico no país.\r\nNão basta colecionar diversas medalhas, o atleta também é um exemplo de pessoa que, sem dúvida, vai continuar brilhando por onde competir.\r\n\r\n&nbsp;\r\n\r\nNós queremos compartilhar histórias dos mais diversos atletas para mostrar o quanto eles são importantes para o esporte nacional e internacional. Você gostou do atleta dessa semana? gostaria de sugerir algum campeão para aparecer neste quadro?\r\nQueremos saber sua sugestão, então corre para nossas redes sociais e fale de alguém que pode aparecer aqui semana que vem.\r\n\r\n&nbsp;\r\n\r\n#ATLETASNOWSUAHORAÉAGORA','Pouca Mídia, Muito Talento!','','publish','closed','closed','','pouca-midia-muito-talento-2','','','2018-07-16 16:26:16','2018-07-16 19:26:16','',0,'https://atletasnow.com/app/?post_type=aprenda&#038;p=300',0,'aprenda','',0),(301,1,'2018-07-16 15:27:09','2018-07-16 18:27:09','Daniel Dias:\n\nEntre as raias de uma piscina, é onde nosso maior atleta Paralímpico, Daniel Dias, costuma esbanjar seu talento.\nDaniel de Faria Dias nasceu no dia 24 de maio de 1988 com uma má formação Congênita nos braços e na perna direita. Desde pequeno, o nadador sempre possuiu interesse por esportes e gostava de praticar alguma atividade física na época da escola. Porém, foi em 2004, nos Jogos Paralímpicos de Atenas, que surgiu o sonho de representar seu país quando viu outro atleta, Clodoaldo Silva, brilhar nas águas e levar seis medalhas de ouro. Nessa edição, Daniel pode conhecer e se interessar pela modalidade dando início na sua trajetória como atleta.\nNo ano de 2006, ele participou da sua primeira competição oficial e de cara faturou duas medalhas de bronze, mas foi no final do ano, na África do Sul, onde o atleta conquistou o lugar mais alto do pódio nos 100m livres, 200m medley e no revezamento 4x50m livre 20pnts.\nEm 2008, nos Jogos de Pequim, Daniel fez sua estreia nos Jogos competindo nas categorias S5, SB4 e SM5 fechando a competição com quatro medalhas de ouro, quatro pratas e um bronze. Na edição seguinte, em Londres, ele obteve sucesso em todas modalidades que participou faturando incríveis seis medalhas de ouro.\nNos jogos do Rio de Janeiro, em 2016, Daniel chegou na competição somando quinze medalhas no currículo, o que já podemos considerar algo impressionante. Mas, o campeão nunca parou de nos surpreender e terminou a competição com quatro medalhas de ouro, três de prata e duas de bronze, somando vinte e quatro medalhas na carreira.\nAtualmente, Daniel continua escrevendo sua história competindo em diversas competições, além de realizar palestras sobre superação e propagar o esporte Paralímpico no país.\nNão basta colecionar diversas medalhas, o atleta também é um exemplo de pessoa que, sem dúvida, vai continuar brilhando por onde competir.\n\nNós queremos compartilhar histórias dos mais diversos atletas para mostrar o quanto eles são importantes para o esporte nacional e internacional. Você gostou do atleta dessa semana? gostaria de sugerir algum campeão para aparecer neste quadro?\nQueremos saber sua sugestão, então corre para nossas redes sociais e fale de alguém que pode aparecer aqui semana que vem.\n\n#ATLETASNOWSUAHORAÉAGORA','Pouca Mídia, Muito Talento!','','inherit','closed','closed','','300-autosave-v1','','','2018-07-16 15:27:09','2018-07-16 18:27:09','',300,'https://atletasnow.com/app/sem-categoria/300-autosave-v1/',0,'revision','',0),(303,1,'2018-07-16 15:55:49','2018-07-16 18:55:49','Bom, talvez a expressão correta ainda pode gerar dúvidas entre muitas pessoas, mas o termo correto (ou definido) é <strong>Paralímpico.\r\n</strong>Não entendeu muito bem? Deixa que a gente explica melhor:\r\nNo final de 2011, o Comitê Olímpico Internacional (COI) modificou o nome para Paralímpico como forma de todos os países se alinharem e utilizarem a mesma linguagem, surgindo o Comitê Paralímpico Internacional. O prazo para todas as instituições se adaptarem e modificarem para Paralímpico foi de um ano.\r\nEm 2016, nos Jogos do Rio, o Brasil adotou o novo termo para se alinhar com todos os outros países, seguindo a orientação do Comitê. Naquele ano, quando o logo oficial foi apresentado, já podíamos ler “Jogos Paralímpicos”\r\nPortanto, na próxima vez que você ler “<strong>Paralímpico</strong>”, quem digitou ou escreveu a palavra não esqueceu do “O” na palavra, apenas adotou a nova medida.<strong>\r\n\r\n</strong>','Afinal: devemos falar Paraolímpico ou Paralímpico?','','publish','closed','closed','','afinal-devemos-falar-paraolimpico-ou-paralimpico','','','2018-07-16 15:55:49','2018-07-16 18:55:49','',0,'https://atletasnow.com/app/?post_type=aprenda&#038;p=303',0,'aprenda','',0),(305,1,'2018-07-17 11:42:06','2018-07-17 14:42:06','Hortência de Fátima Marcari ou apenas Hortência é considerada uma das maiores jogadoras de basquete de todos os tempos. A jogadora é a maior pontuadora da história da seleção, somando incríveis 3.160 pontos, marcados em 127 partidas. Em 2002, todo seu talento a levou ao Hall da Fama do Basquetebol Feminino, nos Estados Unidos e, em 2005,  do Naismith Memorial Basketball Hall of Fame.\r\nSeparamos uma entrevista na qual a jogadora fala sobre sua trajetória, passa todo seu conhecimento e ressalta a importância de amar sua profissão para sempre se manter motivado(a) todos os dias.\r\n\r\n&nbsp;\r\n\r\nhttps://www.youtube.com/watch?v=LF_ZwS-Npt4\r\n\r\n&nbsp;\r\n\r\n<span style=\"color: #000000; font-family: Calibri;\"><strong>Fonte: </strong>\r\nCanal - Foras de Série.\r\nEntrevistada - Hortência| Ex-Jogadora de Basquete.</span>\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;','Uma gigante entre nós','','publish','closed','closed','','uma-gigante-entre-nos','','','2018-07-17 11:42:24','2018-07-17 14:42:24','',0,'https://atletasnow.com/app/?post_type=aprenda&#038;p=305',0,'aprenda','',0),(307,1,'2018-07-17 11:42:15','2018-07-17 14:42:15','<iframe width=\"846\" height=\"476\" src=\"https://www.youtube.com/embed/LF_ZwS-Npt4?feature=oembed\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>','','','publish','closed','closed','','9426bb34764d5500c9c096e5b7dc2479','','','2018-07-17 11:42:15','2018-07-17 14:42:15','',0,'https://atletasnow.com/app/sem-categoria/9426bb34764d5500c9c096e5b7dc2479/',0,'oembed_cache','',0),(308,1,'2018-07-17 12:28:20','2018-07-17 15:28:20','Os cartões amarelos e vermelhos são utilizados para advertir os jogadores de futebol seja por alguma jogada mais violenta, agressão ou discussão contra seu adversário. Porém, o futebol não nasceu com os cartões como forma de sinalizar uma falta, então com o passar do tempo foi necessário criar uma linguagem (ou sinal) universal para os jogadores entenderem essa punição.\r\nTudo começou em 1966 com o polêmico jogo entre Inglaterra e Argentina. Na ocasião, o capitão argentino Rattín questionou uma falta marcada pelo árbitro alemão Rudolf Kreitlein, mas como o juiz não entendia espanhol, utilizou seu dedo para sinalizar a expulsão do jogador de campo diante de uma reclamação mais exaltada.\r\nContudo, existia uma falha de comunicação em campo com um árbitro alemão, jogadores argentinos e os ingleses que, naquele ano, eram a seleção anfitriã.\r\nO chefe dos árbitros recebeu a missão de solucionar o problema para a próxima edição do mundial. A inspiração surgiu quando a caminho do estádio, dentro de um táxi, percebeu que no sinal amarelo o motorista reduzia a velocidade, e no vermelho parava imediatamente. Em 1970, na Copa do México, os cartões foram introduzidos ao jogo com amarelo para advertência e vermelho para expulsão, logo a “simples” invenção se tornou uma linguagem universal entre árbitros e jogadores.\r\nAgora, imagine como seria o futebol sem os cartões nos dias de hoje?\r\n\r\nA equipe da AtletasNow acredita que as histórias que construíram o mundo dos esportes são muito importantes para entendermos como as regras e jogos são aplicados atualmente, por isso, toda semana vamos trazer novas histórias para vocês. Se quiser sugerir alguma outra história, comente em nossas redes sociais.\r\n\r\n&nbsp;\r\n\r\n#ATLETASNOWSUAHORAÉAGORA','Foi lance para cartão?','','publish','closed','closed','','foi-lance-para-cartao','','','2018-07-17 12:30:15','2018-07-17 15:30:15','',0,'https://atletasnow.com/app/?post_type=aprenda&#038;p=308',0,'aprenda','',0),(309,1,'2018-07-17 16:31:19','2018-07-17 19:31:19','','Order &ndash; julho 17, 2018 @ 04:31 PM','','wc-pending','open','closed','order_5b4e4407bfb8d','order-jul-17-2018-0731-pm','','','2018-07-17 16:31:19','2018-07-17 19:31:19','',0,'https://atletasnow.com/app/?post_type=shop_order&p=309',0,'shop_order','',0),(310,1,'2018-07-17 16:31:19','2018-07-17 19:31:19','','Subscription &ndash; Jul 17, 2018 @ 07:31 PM','','wc-pending','open','closed','order_5b4e440a96510','subscription-jul-17-2018-0731-pm','','','2018-07-17 16:31:19','2018-07-17 19:31:19','',309,'https://atletasnow.com/app/?post_type=shop_subscription&p=310',0,'shop_subscription','',0),(312,24,'2018-07-18 15:50:25','0000-00-00 00:00:00','qdwqdqw','','','draft','closed','closed','','','','','2018-07-18 15:50:25','0000-00-00 00:00:00','',0,'https://atletasnow.com/app/?p=312',0,'timeline','',0),(313,24,'2018-07-18 15:50:34','0000-00-00 00:00:00','testasdadsa','','','draft','closed','closed','','','','','2018-07-18 15:50:34','0000-00-00 00:00:00','',0,'https://atletasnow.com/app/?p=313',0,'timeline','',0),(314,24,'2018-07-18 15:51:10','2018-07-18 18:51:10','','1.3_E-Book_Gestão','','inherit','open','closed','','1-3_e-book_gesta%cc%83o','','','2018-07-18 15:51:10','2018-07-18 18:51:10','',0,'https://atletasnow.com/app/wp-content/uploads/2018/07/1.3_E-Book_Gestão.png',0,'attachment','image/png',0),(315,34,'2018-07-18 15:53:44','2018-07-18 18:53:44','','jason-leung-479251-unsplash-1','','inherit','open','closed','','jason-leung-479251-unsplash-1','','','2018-07-18 15:53:44','2018-07-18 18:53:44','',0,'https://atletasnow.com/app/wp-content/uploads/2018/07/jason-leung-479251-unsplash-1.jpg',0,'attachment','image/jpeg',0),(317,1,'2018-07-18 16:24:20','2018-07-18 19:24:20','{{unknown}}','','','publish','closed','closed','','34f3df033438d2aff12a8ac16d406d49','','','2018-07-18 16:24:20','2018-07-18 19:24:20','',0,'https://atletasnow.com/app/sem-categoria/34f3df033438d2aff12a8ac16d406d49/',0,'oembed_cache','',0),(322,1,'2018-07-18 16:53:41','2018-07-18 19:53:41','Maria Lenk  - 1ª Brasileira a participar dos Jogos Olímpicos:\r\n\r\n&nbsp;\r\n\r\nForam das raias das piscinas que emergiu a primeira mulher a disputar os Jogos Olímpicos pelo Brasil. Maria Emma Hulga Lenk Zigler ou Maria Lenk, foi pioneira para a natação feminina.\r\nEla começou cedo no esporte, conquistou títulos nacionais nadando pelo Flamengo e,\r\ncom apenas 17 anos, a nadadora embarcou com a federação composta por homens e uma única mulher para os Jogos Olímpicos na cidade de Los Angeles, em 1932.\r\nEm sua estreia, ela competiu em três provas: os 100m livres, 100m costas e 200m peito. A debutante não conquistou medalhas, mas sua participação foi um marco em uma época na qual a presença feminina não era comum.\r\nEla participou de outras edições dos jogos e outros campeonatos de natação, quebrou recordes mundiais nos 400m e 200m e fora das piscinas, em 1942, ajudou na fundação da Escola Nacional de Educação Física da Universidade do Brasil, UFRJ, no Rio de Janeiro. Escreveu o livro “Longevidade e Esporte” falando dos benefícios da natação para seus praticantes e chegou ao Hall da Fama da federação internacional de Natação.\r\nInfelizmente, faleceu no ano de 2007 enquanto nadava na piscina do Flamengo devido uma parada cardiorrespiratória.\r\nCom toda essa bagagem e por tudo que Maria Lenk fez pelo esporte, não somente podemos dizer que ela fez história, mas se tornou uma lenda do país!\r\n\r\n&nbsp;\r\n\r\n#ATLETASNOWSUAHORAÉAGORA\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;','Pouca Mídia, Muito Talento!','','publish','closed','closed','','pouca-midia-muito-talento-3','','','2018-07-23 15:33:37','2018-07-23 18:33:37','',0,'https://atletasnow.com/app/?post_type=aprenda&#038;p=322',0,'aprenda','',0),(324,121,'2018-07-18 23:56:27','2018-07-19 02:56:27','','ENG-UVA-TIJUCA','','inherit','open','closed','','eng-uva-tijuca','','','2018-07-18 23:56:27','2018-07-19 02:56:27','',0,'https://atletasnow.com/app/wp-content/uploads/2018/07/ENG-UVA-TIJUCA.png',0,'attachment','image/png',0),(325,96,'2018-07-19 09:51:16','2018-07-19 12:51:16','','IMG-20180713-WA0027','','inherit','open','closed','','img-20180713-wa0027','','','2018-07-19 09:51:16','2018-07-19 12:51:16','',0,'https://atletasnow.com/app/wp-content/uploads/2018/07/IMG-20180713-WA0027.jpeg',0,'attachment','image/jpeg',0),(326,1,'2018-07-19 10:59:32','0000-00-00 00:00:00','&nbsp;\n\nA popularidade do Futebol Americano cresceu muito nos últimos anos. Atualmente, não precisamos procurar muito para encontramos algum torcedor fanático ou estabelecimentos que vão transmitir jogos importantes. No país predominado pelo futebol, a bola oval já ganhou seu espaço, mas ainda pode gerar algumas dúvidas para os novos adeptos, por isso, separamos um vídeo que explica as regras básicas do jogo para você entender melhor como ele funciona.\n\n\n\n&nbsp;\n\nFonte:\nCanal Oficial – NFL\nNarração e Explicação – Everaldo Marques\n&nbsp;','Entendendo o Futebol Americano','','draft','closed','closed','','','','','2018-07-19 10:59:32','2018-07-19 13:59:32','',0,'https://atletasnow.com/app/?post_type=aprenda&#038;p=326',0,'aprenda','',0),(327,1,'2018-07-19 17:07:33','2018-07-19 20:07:33','O mundo dos esportes além de nos proporcionar momentos incríveis e emocionantes, também pode nos ensinar muito. Por isso, separamos uma lista que todo admirador do esporte não pode deixar de ter em sua coleção:\r\n\r\n&nbsp;\r\n\r\nGuga, um brasileiro\r\n\r\nGuga é uma referência para o esporte brasileiro e um dos maiores atletas da história do tênis.\r\nSempre muito carismático, seu talento e dedicação foram compensados com uma trajetória de sucesso e muitas conquistas. Este livro mostra os bastidores de sua carreira desde o início, glórias e momentos que precisou lidar com lesões mostrando toda sua superação.\r\n\r\n&nbsp;\r\n\r\nOscar Schmidt: 14 Motivos Para Viver, Vencer e Ser Feliz\r\n\r\nOscar nunca jogou a NBA, mas atingiu um feito que poucos atletas conseguem: chegou ao Hall da Fama do Basquete. No livro, o ex-jogador compartilha suas histórias de como se tornou um atleta campeão e usa sua dedicação para vencer todos os obstáculos.\r\n\r\n&nbsp;\r\n\r\nAlex Ferguson: Liderança\r\n\r\nAlex Ferguson treinou o Manchester United por muitos anos conquistando todos os títulos possíveis, além de treinar e revelar craques ao longo desses anos. A obra traz os segredos do treinador, o que é necessário para construir equipes de alto rendimento, como lidar com o fracasso e como alcançar o sucesso.\r\n\r\n&nbsp;\r\n\r\nMarketing Esportivo - Uma Visão Estratégica e Atual\r\n\r\nVoltado para os negócios por trás dos esportes, o livro apresenta conceitos de Marketing aplicados no mundo esportivo e estratégias inovadoras para este mercado englobando as mais diversas modalidades.\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\nGostou das nossas dicas? Gostaria de recomendar outro livro? Comente em nossas redes sociais algum livro para que todos os amantes do esporte possam ler, se divertir e aprender.\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n#ATLETASNOWSUAHORAÉAGORA','Livros que você não pode deixar de ler!','','publish','closed','closed','','livros-que-voce-nao-pode-deixar-de-ler','','','2018-07-20 10:29:39','2018-07-20 13:29:39','',0,'https://atletasnow.com/app/?post_type=aprenda&#038;p=327',0,'aprenda','',0),(328,75,'2018-07-19 18:45:34','2018-07-19 21:45:34','','AtletasNow-Logo','','inherit','open','closed','','atletasnow-logo','','','2018-07-19 18:45:34','2018-07-19 21:45:34','',0,'https://atletasnow.com/app/wp-content/uploads/2018/07/AtletasNow-Logo.jpg',0,'attachment','image/jpeg',0),(329,75,'2018-07-19 18:46:24','0000-00-00 00:00:00','uhuuuuuuuuuul','','','draft','closed','closed','','','','','2018-07-19 18:46:24','0000-00-00 00:00:00','',0,'https://atletasnow.com/app/?p=329',0,'timeline','',1),(333,1,'2018-07-20 10:29:27','2018-07-20 13:29:27','O mundo dos esportes além de nos proporcionar momentos incríveis e emocionantes, também pode nos ensinar muito. Por isso, separamos uma lista que todo admirador do esporte não pode deixar de ter em sua coleção:\n\n&nbsp;\n\nGuga, um brasileiro\n\nGuga é uma referência para o esporte brasileiro e um dos maiores atletas da história do tênis.\nSempre muito carismático, seu talento e dedicação foram compensados com uma trajetória de sucesso e muitas conquistas. Este livro mostra os bastidores de sua carreira desde o início, glórias e momentos que precisou lidar com lesões mostrando toda sua superação.\n\n&nbsp;\n\nOscar Schmidt: 14 Motivos Para Viver, Vencer e Ser Feliz\n\nOscar nunca jogou a NBA, mas atingiu um feito que poucos atletas conseguem: chegou ao Hall da Fama do Basquete. No livro, o ex-jogador compartilha suas histórias de como se tornou um atleta campeão e usa sua dedicação para vencer todos os obstáculos.\n\n&nbsp;\n\nAlex Ferguson: Liderança\n\nAlex Ferguson treinou o Manchester United por muitos anos conquistando todos os títulos possíveis, além de treinar e revelar craques ao longo desses anos. A obra traz os segredos do treinador, o que é necessário para construir equipes de alto rendimento, como lidar com o fracasso e como alcançar o sucesso.\n\n&nbsp;\n\nMarketing Esportivo - Uma Visão Estratégica e Atual\n\nVoltado para os negócios por trás dos esportes, o livro apresenta conceitos de Marketing aplicados no mundo esportivo e estratégias inovadoras para este mercado englobando as mais diversas modalidades.\n\n&nbsp;\n\n&nbsp;\n\nGostou das nossas dicas? Gostaria de recomendar outro livro? Comente em nossas redes sociais algum livro para que todos os amantes do esporte possam ler, se divertir e aprender.\n\n&nbsp;\n\n&nbsp;\n\n#ATLETASNOWSUAHORAÉAGORA','Livros que você não pode deixar de ler!','','inherit','closed','closed','','327-autosave-v1','','','2018-07-20 10:29:27','2018-07-20 13:29:27','',327,'https://atletasnow.com/app/sem-categoria/327-autosave-v1/',0,'revision','',0),(335,1,'2018-07-20 12:49:07','2018-07-20 15:49:07','Outro final de semana chegando, mas isso não significa que o mundo dos esportes vai repousar. Separamos o que de mais legal podemos ver no próximo final de semana, então se programe e não deixe de conferir os eventos abaixo:\r\n\r\n<strong> </strong>\r\n\r\n<strong>Futebol:\r\n</strong>Depois da ressaca pós-Copa do mundo, os times ao redor do mundo e nosso campeonato nacional estão de volta. Para você matar a saudade de forma organizada, separamos os principais jogos e torneios que vão acontecer:\r\n\r\n<strong> </strong>\r\n\r\n<strong>Futebol Europeu:</strong>\r\n\r\nOs times do velho continente estão espalhados pelo mundo para iniciar sua preparação para a próxima temporada.\r\n\r\n&nbsp;\r\n\r\nFOX Sports: Bayern de Munique X Paris Saint-Germain – 21/07 – 11h (Ao vivo)\r\n\r\n&nbsp;\r\n\r\nSportv2: Inter de Milão (ITA) X Zenit (RUS) – 21/07 – 15h10 (Ao vivo)\r\n\r\n&nbsp;\r\n\r\nFox Sports: Liverpool (ING) X Borrusia Dortmund (ALE) – 22/07 – 17h (Ao vivo)\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n<strong>Futebol Nacional:</strong>\r\n\r\nO campeonato nacional está de volta e chegou a hora de você matar a saudade do seu time.<strong>\r\n</strong>\r\n<strong>Sábado:</strong>\r\n\r\nSportv: Coritiba X São Bento – Série B – 21/07 – 16h (Ao vivo)\r\n\r\n&nbsp;\r\n\r\nSportv: Boa Esporte X Ponte Preta – Série B – 21/07 – 18h30 (Ao vivo)\r\n\r\n&nbsp;\r\n\r\nPremiere: Flamengo X Botafogo – Série A – 21/07 – 19h (Ao vivo)\r\n\r\n&nbsp;\r\n\r\nPremiere: São Paulo X Corinthians – Série A – 21/07 – 21h (Ao vivo)\r\n\r\n&nbsp;\r\n\r\n<strong>Domingo:</strong>\r\n\r\nSportv: Chapecoense X Santos – Série A – 22/07 – 17h (Ao vivo)\r\n\r\n&nbsp;\r\n\r\nPremiere: Palmeiras X Atlético MG – Séria A – 22/07 – 16h (Ao vivo)\r\n\r\n&nbsp;\r\n\r\nPremiere: Bahia X Vitória – Série A – 22/07 – 16h (Ao vivo)\r\n\r\n&nbsp;\r\n\r\nPremiere: Sport X Fluminense – Série A – 22/07 – 16h (Ao Vivo)\r\n\r\n&nbsp;\r\n\r\n<strong>\r\nAutomobilismo:</strong>\r\n\r\nNas pistas e autódromos espalhados por todo mundo, os corredores estão disputando cada curva para chegar ao lugar mais alto do pódio.\r\n\r\n&nbsp;\r\n\r\n<strong>Sábado</strong>\r\n\r\nSportv2: 3º treino livre de Fórmula 1 – GP da Alemanha – 21/07 – 06h45 (Ao vivo)\r\n\r\n&nbsp;\r\n\r\nSportv2: treino oficial de Fórmula 1 – GP da Alemanha – 21/07 – 09h30 (Ao vivo)\r\n\r\n&nbsp;\r\n\r\nSportv2: Campeonato Brasileiro de Kart – 21/07 – 11H25 (Ao vivo)\r\n\r\n&nbsp;\r\n\r\n<strong>Domingo</strong>\r\n\r\nSportv2: Porshe Supercup – GP da Alemanha – 22/07 - 07h00 (Ao vivo)\r\n\r\n&nbsp;\r\n\r\nRede Globo: Fórmula 1 – GP da Alemanha – 22/07 - 10h10 (Ao vivo)\r\n\r\n&nbsp;\r\n\r\n<strong>Luta:</strong>\r\n\r\nOs ringes e octógonos também vão estar presentes nos principais eventos deste final de semana.\r\n\r\n&nbsp;\r\n\r\n<strong>Sábado:</strong>\r\nSportv: Boxe Internacional: Yamagushi Falcão X Elias Espadas/ Munguia X Smith – 21/07 – 21h55 (Ao vivo)\r\n\r\n&nbsp;\r\n\r\n<strong>Domingo</strong>:\r\nSportv2: UFC: Shogun X Smith – Card Preliminar – 22/07 – 11h30 (Ao vivo)\r\n\r\n&nbsp;\r\n\r\n<strong>Esports</strong>\r\nEnquanto alguns vão usar videogame para relaxar, outros vão competir profissionalmente.\r\n\r\n&nbsp;\r\n\r\n<strong>Sábado</strong>:\r\nEsporte Interativo: EI Games – 21/07 – 12h (Ao vivo)\r\n\r\n&nbsp;\r\n\r\nSportv2: CBLOL – 21/07 – 13h (Ao vivo)\r\n\r\n&nbsp;\r\n\r\n<strong>Hipismo:\r\n</strong>Na Alemanha, o campeonato de Hipismo também não para e você não pode deixar de conferir a próxima etapa da competição.\r\n\r\n&nbsp;\r\n\r\nSportv3: Chio Aachen de Hipismo – Grand Prix – 22/07 – 08h20 (Ao vivo)\r\n\r\n&nbsp;\r\n\r\n<strong>X-Games</strong>\r\nPara os amantes dos esportes radicais, opções também não vão faltar.\r\n\r\n&nbsp;\r\n\r\n<strong>Sábado</strong>:\r\nESPN: X-GAMES MINNEAPOLIS 2018: FINAL BMX DIRT, MOTO X BEST WHIP, MOTO X BEST TRICK E SKATE BIG AIR – 21/07 – 20h (Ao Vivo)\r\n\r\n&nbsp;\r\n\r\n<strong>Domingo:</strong>\r\nESPN: X-GAMES MINNEAPOLIS 2018: FINAL HARLEY DAVIDSON, SKATE PARK FEMININO, SKATE STREET E BMX PARK MASCULINO – 22/07 – 14h (Ao vivo)\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\nDesejamos muita diversão e esportes para todos.\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n#ATLETASNOWSUAHORAÉAGORA','O esporte NUNCA descansa!','','publish','closed','closed','','o-esporte-nunca-descansa-2','','','2018-07-20 12:54:16','2018-07-20 15:54:16','',0,'https://atletasnow.com/app/?post_type=aprenda&#038;p=335',0,'aprenda','',0),(336,1,'2018-07-20 12:51:40','2018-07-20 15:51:40','Outro final de semana chegando, mas isso não significa que o mundo dos esportes vai repousar. Separamos o que de mais legal podemos ver no próximo final de semana, então se programe e não deixe de conferir os eventos abaixo:\n\n<strong> </strong>\n\n<strong>Futebol:\n</strong>Depois da ressaca pós-Copa do mundo, os times ao redor do mundo e nosso campeonato nacional estão de volta. Para você matar a saudade de forma organizada, separamos os principais jogos e torneios que vão acontecer:\n\n<strong> </strong>\n\n<strong>Futebol Europeu:</strong>\n\nOs times do velho continente estão espalhados pelo mundo para inici