nguia X Smith – 21/07 – 21h55 (Ao vivo)\n\n<strong>Domingo</strong>:\nSportv2: UFC: Shogun X Smith – Card Preliminar – 22/07 – 11h30 (Ao vivo)\n\n<strong>Esports</strong>\nEnquanto alguns vão usar videogame para relaxar, outros vão competir profissionalmente.\n\n<strong>Sábado</strong>:\nEsporte Interativo: EI Games – 21/07 – 12h (Ao vivo)\n\nSportv2: CBLOL – 21/07 – 13h (Ao vivo)\n\n<strong>Hipismo:\n</strong>Na Alemanha, o campeonato de Hipismo também não para e você não pode deixar de conferir a próxima etapa da competição.\n\nSportv3: Chio Aachen de Hipismo – Grand Prix – 22/07 – 08h20 (Ao vivo)\n\n<strong>X-Games</strong>\nPara os amantes dos esportes radicais, opções também não vão faltar.\n\n<strong>Sábado</strong>:\nESPN: X-GAMES MINNEAPOLIS 2018: FINAL BMX DIRT, MOTO X BEST WHIP, MOTO X BEST TRICK E SKATE BIG AIR – 21/07 – 20h (Ao Vivo)\n\n<strong>Domingo:</strong>\nESPN: X-GAMES MINNEAPOLIS 2018: FINAL HARLEY DAVIDSON, SKATE PARK FEMININO, SKATE STREET E BMX PARK MASCULINO – 22/07 – 14h (Ao vivo)\n\nDesejamos muita diversão e esportes para todos.\n\n#ATLETASNOWSUAHORAÉAGORA','O esporte NUNCA descansa!','','inherit','closed','closed','','335-autosave-v1','','','2018-07-20 12:51:40','2018-07-20 15:51:40','',335,'https://atletasnow.com/app/sem-categoria/335-autosave-v1/',0,'revision','',0),(338,1,'2018-07-20 15:56:52','2018-07-20 18:56:52','&nbsp;\r\n\r\nAndar de bicicleta, além de ser uma atividade prazerosa, traz diversos benefícios para nossa saúde. Seja na ciclovia, ciclo faixa, na academia ou mesmo no parque mais próximo da sua residência, espaços para praticar o esporte não vão faltar. Separamos alguns benefícios que pedalar podem para sua saúde:\r\n\r\n&nbsp;\r\n<ul>\r\n 	<li>Previne doenças cardiovasculares;</li>\r\n 	<li>Auxilia no controle da pressão arterial;</li>\r\n 	<li>Ajuda na prevenção de hérnias de disco;</li>\r\n 	<li>Melhora sua cognição;</li>\r\n 	<li>Auxilia no emagrecimento;</li>\r\n 	<li>Melhora a frequência cardíaca;</li>\r\n 	<li>Fortalece os músculos;</li>\r\n 	<li>Diminui o estresse.</li>\r\n</ul>\r\n&nbsp;\r\n\r\nDepois de ler todas essas dicas, o que você está esperando para tirar sua Bike de casa?\r\n\r\n&nbsp;\r\n\r\n#ATLETASNOWSUAHORAÉAGORA\r\n\r\n&nbsp;','Vamos pedalar?','','publish','closed','closed','','vamos-pedalar','','','2018-07-20 15:58:34','2018-07-20 18:58:34','',0,'https://atletasnow.com/app/?post_type=aprenda&#038;p=338',0,'aprenda','',0),(340,126,'2018-07-21 13:30:29','0000-00-00 00:00:00','Sou mais um sonhador, apesar da idade \"avançada\" pro futebol me espelho em jogadores que começaram tarde como durval e grafite.','','','draft','closed','closed','','','','','2018-07-21 13:30:29','0000-00-00 00:00:00','',0,'https://atletasnow.com/app/?p=340',0,'timeline','',0),(341,126,'2018-07-21 13:30:59','2018-07-21 16:30:59','','FB_IMG_1532190320845','','inherit','open','closed','','fb_img_1532190320845','','','2018-07-21 13:30:59','2018-07-21 16:30:59','',0,'https://atletasnow.com/app/wp-content/uploads/2018/07/FB_IMG_1532190320845.jpg',0,'attachment','image/jpeg',0),(354,134,'2018-07-31 13:27:57','2018-07-31 16:27:57','','Atleticanew','','inherit','open','closed','','atleticanew','','','2018-07-31 13:27:57','2018-07-31 16:27:57','',0,'https://atletasnow.com/app/wp-content/uploads/2018/07/Atleticanew.png',0,'attachment','image/png',0),(357,159,'2018-08-02 22:40:28','2018-08-03 01:40:28','','FB_IMG_1533175775060','','inherit','open','closed','','fb_img_1533175775060','','','2018-08-02 22:40:28','2018-08-03 01:40:28','',0,'https://atletasnow.com/app/wp-content/uploads/2018/08/FB_IMG_1533175775060.jpg',0,'attachment','image/jpeg',0),(358,159,'2018-08-02 22:40:31','2018-08-03 01:40:31','','IMG-20180801-WA0062','','inherit','open','closed','','img-20180801-wa0062','','','2018-08-02 22:40:31','2018-08-03 01:40:31','',0,'https://atletasnow.com/app/wp-content/uploads/2018/08/IMG-20180801-WA0062.jpg',0,'attachment','image/jpeg',0),(360,163,'2018-08-03 09:32:34','2018-08-03 12:32:34','','IMG-