minha vida no jiu-jitsu e judô, com medo de nunca consegui chegar a um nível alto, sempre me reprimia a não competir pra não desapontar os meus amigos de treino, porém sempre me falavam que eu tava bem, mas eu não me sentia preparado pra competir e o tempo foi passando e quando me graduei na faixa roxa, fiquei mais confiante e a comecei a competir, perdi algumas, ganhei outras e a vida continuava, e então fui enfrentar meu primeiro campeonato fora do Amapá, fui em Belém PA lutar um Open internacional, e conquistei o segundo lugar de forma maravilhosa e dali em diante eu me sentia pronto pra guerra... Passando por algumas dificuldade eu fui evoluindo, montei um projeto social que funciona até hoje na minha casa no Amapá que está sendo conduzido atualmente por um amigo, então no final de 2017 eu fui graduado então faixa marrom de jiu-jitsu onde fiquei muito feliz e sabia que o caldo iria engrossar bastante, então voltei em Belém PA para lutar o Sul-Americano de jiu-jitsu esportivo e me consagrei CAMPEÃO da minha categoria, nossa foi maravilhoso, e minha estrada só estava no início e tracei um objetivo de lutar o mundial em 2018 e isso aconteceu e eu lutei bem categoria e absoluto, porém fiquei nas quartas de finais no absoluto e me consagrei 3 lugar na categoria, mesmo sem ajuda, sem patrocínio, sem suplementos, só com o meu Deus... Meus amigos de equipe (BLACK NORTE JIU-JITSU) meu mestre Kenny Dias, Com meu açaí kkkk, muito feijão com arroz e frango kkkkkkk\nHoje sou atleta, ativo, competindo e enfrentando os mesmo obstáculos de sempre, hoje morando em Chapecó não tenho mais meu açaí, rsrs só meu feijão com arroz e frango... \nPorém tenho o meu Deus que me torna grande pra que seu nome seja lembrado sempre...\nAgradeço a ajuda dos senhores em me divulgar e mostrar um pouco da minha história, obrigado por tudo...\n\nEstou me preparando para lutar o Grand Slam no Rio de janeiro e o Mundial de jiu-jitsu em São Paulo.','','','open','open','open','','','','','2019-06-07 0